INSERT INTO `destinationprofile` VALUES (1,NULL,'2019-07-31 19:15:47.943861','admin@techtranz.com','2020-07-16 09:52:42.180382',1,1,NULL,'Habtoor Grand Resort, Autograph Collection','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSituated on Dubai\'s world-famous Jumeirah Beach and adjacent to the magnificent Dubai Marina, Habtoor Grand Resort, Autograph Collection, occupies one of Dubai’s most enchanting beachside locations. \r \r Perfect for both business and leisure travelers, the resort features three pools, including kid’s pool with water slide, variety of indoor and al fresco dining outlets, superb fitness and Spa facilities, advanced Convention and Banqueting Center. \r \r Welcome to a paradise of perfect vistas, where lush landscapes meet warm waters of the Arabian Gulf, framed by pristine beaches and clear blue skies. 446 guest rooms and suites offer a generous variety of 5-star accommodation at the white shore of the Gulf. The majority of the spacious Tower Rooms have direct or partial sea view, while Garden Rooms enjoy the embrace of landscaped gardens. Club Rooms, Ambassador, Royal, Penthouse and Presidential Suites impress their guests with rich Arabic luxury and hospitality.\r \r In the heart of the prestigious Dubai Marina at the very beginning of the world-famous Jumeirah Beach Strip. The hotel is just 25 minutes away from Dubai International Airport (DXB) and just 30 minutes from Al Maktoum International Airport (DWC) and surrounded by the Arabian Gulf, shopping malls and Dubai’s most featured restaurants.','Al Falea Street','Jumeirah Beach','',1,1,'043995000',NULL,'55.1400667','25.0859939',NULL,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJwQK0WFJrXz4RTP7D5F4Dku0',_binary '',0,0,2),(1,NULL,'2019-08-02 12:00:36.051464','admin@techtranz.com','2019-12-20 08:20:34.989855',2,1,NULL,'Hyatt Regency Dubai Creek Heights','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLocated by Dubai Creek, Hyatt Regency Dubai Creek Heights offers modern accommodations with sleek interiors. The hotel features an outdoor swimming pool, 24-hour gym, a luxurious spa and a kids’ club. Free WiFi is available in all areas. The hotel is 10 minutes away by car from Burj Khalifa and Dubai Mall.\n\nEach guestroom overlooks Dubai Creek or the city skyline and provides a free non-alcoholic minibar, individually-controlled air conditioning and coffee/tea making facilities. All rooms feature a walk-in rain shower, separate bathtub and complimentary toiletries and bedroom slippers. A safety deposit box is also available in the room.\n\nOther amenities include a beauty salon, free valet parking and luggage storage.\n\nThe hotel is 5 km from Al Ghurair Centre, 7 km from Dubai International Convention and Exhibition Centre and a 20-minute drive to Jumeirah Beach. Dubai International Airport is 10 minutes away.\n\nBur Dubai is a great choice for travellers interested in sightseeing, tourist attractions and shopping.','20th Street','Dubai Healthcare City','Bur Dubai Hyatt Regency Dubai Creek Heights - Dubai 5668',1,1,'+971 4 553 1234',NULL,'55.3235158','25.2346328',NULL,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJs7CUFDddXz4RoUfAZztaxq4',_binary '\0',0,0,NULL),(1,NULL,'2019-08-02 15:03:25.488932','admin@techtranz.com','2019-12-24 11:47:17.689751',3,2,NULL,'Luciano\'s','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSet alongside the garden pool, Luciano\'s offers traditional Italian fare in an atmosphere that is unmistakably enriching.','Al Falea Street','Jumeirah Beach','Jumeirah Beach Residence',1,1,'044084257',NULL,'55.1400667','25.0859939',1,1,'2019-11-22 12:30:00.000000','2019-11-22 23:30:00.000000','ChIJwQK0WFJrXz4RTP7D5F4Dku0',_binary '',0,0,NULL),(1,NULL,'2019-08-02 15:06:17.285952','admin@techtranz.com','2019-11-22 13:34:54.901778',4,2,NULL,'Eve Penthouse & Lounge','COVID Notice: Due to limited capacity, we r