red Osteria Francescana (voted #1 in the World in 2016 & 2018), brings his first restaurant outside of Italy to W Dubai – The Palm. \n\nHe shows us his favorite way to hit escape by taking guests on a journey back to the 1960’s Italian Riviera where everything is sophisticated and social, but laid back.','West Crescent','Palm Jumeirah','',1,1,'042455800',NULL,'55.1113342','25.1062293',1,116,'2019-11-21 12:00:00.000000','2019-11-21 23:00:00.000000','ChIJbTHIgIEVXz4RIPXU6nFB2Gs',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 02:07:35.611980','admin@techtranz.com','2020-01-11 12:22:54.413068',118,2,NULL,'Akira Back','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nPro snowboarder turned adrenaline-fueled culinary master, Chef Akira Back brings his modern tastes of Japanese cuisine prepared with a Korean essence to the Middle East for the first time.  His restaurant sits atop W Dubai - The Palm, soaking in panoramic views of the Palm and city.  It is a complete adventure for your soul.\n\nChef Akira and his team, led by Chef de Cuisine Giovanni Ledon, strive to bring a new dimension to Japanese cuisine and create a memorable experience for the guests by exploring the endless possibilities of combining interesting ingredients and unexpected flavours.  It is where guests can mix + mingle while sharing a plate or two or three.\n\nThe energy behind-the-scenes fuel the flavours.  Sushi, a Robata grill, Wagyu beef tenderloin or vegan - all tastes are welcome. Signature dishes include Chef Akira\'s tuna pizza and AB tacos.\n\nThe indoor/outdoor space provides a dramatic backdrop where everyone has a panoramic view in the foreground. The entrance to the restaurant is a vortex that brings you one step closer to heaven. Upon entering, you\'ll notice the detail in abstract design; including artwork from Chef Akira\'s mother, cloud like structures on the ceiling, wabi sabi finishings and tiger stripes to honor his zodiac sign. The rooftop terrace is ideal for pre/post dinner or just for some small bites, with the floating bar as a focal point.  There is also a private dining room for those sharing an intimate occasion.\n\nDaily, 7:00PM – 12:30AM (weekdays) and 7:00PM – 1:00AM (weekends)\n','West Crescent Palm Jumeirah','','',1,1,'042455800',NULL,'55.1113342','25.1062293',1,116,'2019-11-21 19:00:00.000000','2019-11-21 01:00:00.000000','ChIJbTHIgIEVXz4RIPXU6nFB2Gs',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 02:08:29.434623','admin@techtranz.com','2020-01-18 16:40:18.999939',119,2,NULL,'SoBe','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe only rooftop bar on the Palm with 360° views and THE place for an unobstructed sunset. You’ll be obsessed with the limitless POVs; from the Arabian Sea, to the Palm, to the Dubai skyline.\n\nW Dubai – The Palm gives you access to this adults-only playground that presents the alternative side of South Beach. Art deco colours flank street art, while you catch glimpses of roaming entertainment snaking through the venue to the beats of live entertainment. \n\nAs the sun goes down and the skyline lights come up - the vibe is set. Come as you are, do as you please. #SoBeYourself.','West Crescent','Palm Jumeirah','',1,1,'042455800',NULL,'55.1113342','25.1062293',1,116,'2019-11-21 16:00:00.000000','2019-11-21 03:00:00.000000','ChIJbTHIgIEVXz4RIPXU6nFB2Gs',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 02:09:45.247660','admin@techtranz.com','2020-01-18 16:40:43.685042',120,2,NULL,'WET Deck','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe WET Deck is the epicenter of the Escape and allows the guests to have it all; from mixing & mingling with signature cocktails near the DJ booth to soaking it all in by their sun lounges on the beach. The WET Deck is also host to our Palm Sugar Brunch, your Friday go-to destination.\n\nOffering a fresh menu, you’ll find we won’t weigh you down when you’re up for anything! Whether it’s a detox day by the pool, sunbathing on our pristine beach, or you simply want to retox, you will find the right vibe at WET.\n\nBe in the center of the action without being the center of attention.  Choose from the Palm Sugar Brunch on Fridays to delectable bites every day. Imbibe on a cool cocktail or refuel with a freshly squeezed juice. We have what you need to beat the heat.\n\nDaily, 7:00AM – 7:00PM\n','West Crescent','Palm Jumeirah','',1,1,'042455800',NULL,'55.1113342','25.1062293',1,116,'2019-12-09 07:00:00.000000','2019-12-09 19:00:00.000000','ChIJbTHIgIEVXz4RIPXU6nFB2Gs',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 02:10:38.940601','admin@techtranz.com','2020-01-18 16:40:59.498254',121,2,NULL,'W Lounge','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFind our most eclectic cocktails, refreshing bevvies and more, located cozily within the Atrium. Relax with delicious bites, curated coffee during the day or chill out with pre/post dinner drinks. Access a playful T-Time setup and settle in with sweet, savory and a selection of tea. \n\nDaily, 8:00AM – 10:00PM.\n','West Crescent','Palm Jumeirah','',1,1,'042455800',NULL,'55.1113342','25.1062293',4,116,'2019-12-09 08:00:00.000000','2019-12-09 22:00:00.000000','ChIJTxoaLwYVXz4R_SVYO5e2Qgw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 02:13:19.529227','admin@techtranz.com','2020-01-18 16:41:54.524599',122,2,NULL,'Away Spa - W Dubai - The Palm','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLook good, feel good, spread the word. \n\nAWAY Spa is rejuvenation realized, offering full body treatments and services that replenish your spirit. We\'re zen with a side of zany, and our style is more fab than feng shui. \n\nWalk through our front door and find reflective wall tiles and vibrant murals next to avant-garde décor. Enter massage rooms with otherworldly lighting and design. Each of our 11 spaces