n are what await your little ones at Qix club. Sit back and relax or go\non a shopping trip to Dubai Marina Mall, while your children are being looked after and enjoy a perfect balance of\nedutainment, fun and healthy activities.',' Al Marsa Street 66 ','Dubai Marina','P.O. Box 32923',1,1,'044367777',NULL,'55.1379812','25.0774671',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJbQjl4EFDXz4RFUUy8awWyxk',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 10:57:31.056428','admin@techtranz.com','2020-01-05 19:26:48.696393',132,2,NULL,'Mazina','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nAn all-day dining restaurant that offers sweeping views of Dubai Marina and an eclectic variety of dishes from around the globe. Five open kitchens serve an array of Asian, Arabic and European specialities, from Cantonese wok dishes to rotisserie grill. Chic and tasteful in its interiors and cuisine, and known for hosting spectacular brunches over the weekends, this restaurant immerses you in its stylish splendour.\n\n\nChildren up to the age of 5 years - complimentary dining.\nChildren between the age of 6 years and 11 years - 50% off dining.\n\nPowered by OpenTable®. By completing this reservation, you agree to OpenTable®\'s Terms of Use and Privacy Policy.\n\nOpening hours:\nBreakfast: 6.30am to 10.30am and Dinner: 7.00pm to 11.00pm\nLunch: 12.00pm to 3.00pm\nBrunch: Friday and Saturday: 12.30pm to 3.30pm\n\nDress code:\nSmart Casual\n\nLocation:\nLobby level\nAddress Dubai Marina\n\ndine@emaar.com\n+97148883444\n\nAlcohol is limited to house beverages\n\n','Al Marsa Street 66 ','Dubai Marina','',1,1,'048883444',NULL,'55.1379812','25.0774671',1,131,'2019-11-20 06:30:00.000000','2019-11-20 23:00:00.000000','ChIJbQjl4EFDXz4RFUUy8awWyxk',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 11:00:40.563191','admin@techtranz.com','2020-01-05 19:26:56.623774',133,2,NULL,'Shades','COVID Notice: Due to limited capacity, we