e by the Pool','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWhether you’re reclining on a sun lounger or strolling through greenery, there’s always more for you to discover within the resort’s beautifully landscaped grounds','Abu Dhabi Gold Club','Sas Al Nakhl','',2,1,'+971 2 616 9999',NULL,'54.5286159','24.4193366',2,152,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJaVu-AqlGXj4Rol1jDv2oPSc',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:13:08.829667','admin@techtranz.com','2020-01-22 15:48:28.253167',164,1,NULL,'Beach Rotana - Abu Dhabi','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nAn award-winning city resort with a prime waterside location and an enviable selection of modern leisure, dining and business facilities, Beach Rotana Abu Dhabi is much more than a hotel; it is a one-of-a-kind destination.\n\nIt provides direct access to the shops, services and entertainment attractions at adjacent Abu Dhabi Mall and is just minutes from the new Central Business District and Abu Dhabi National Exhibition Centre (ADNEC). Cultural and leisure attractions are also close by, from Sheikh Zayed Grand Mosque, Qasr Al Watan at the Presidential Palace and The Louvre Abu Dhabi to the stunning Corniche, Saadiyat Island and Yas Island with its fun theme parks. \n\nWith 12 remarkable and eclectic dining experiences under one roof, Beach Rotana Abu Dhabi is a gastronomic destination like no other. From succulent seafood at our popular over-water restaurant Finz, freshly-made Italian fare at Prego’s, Indian fusion delights at Indigo and fine steaks at Rodeo Grill, to exotic French-Polynesian dishes at Trader Vic’s, authentic German cuisine at Brauhaus and American-Japanese favourites at Benihana and so much more, you are spoiled for choice. Cafés, lounges, beach bars and in-room dining are also part of our impressive culinary offering.\n\nYou can follow your fitness regime at the fully-equipped gym, get sporty on the tennis or squash courts, or have some outdoor fun with the kids on the 120-metre beach or by the infinity pool at our Beach Club with a glamorous waterside location. For the ultimate in relaxation and rejuvenation, indulge in a signature massage, mud or bath treatment at Zen the spa.','10th Street','Al Zahiyah Area','',2,1,'026979000',NULL,'54.3838496','24.4945298',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','aChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:15:22.414418','admin@techtranz.com','2020-01-18 16:47:35.376940',165,2,NULL,'Finz','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFor a sophisticated over-water dining experience where the seafood is incredibly fresh and the outlook memorably scenic, try our signature restaurant Finz, a venue where fashion meets finesse. You can stroll along the shores of the bay to this magical seaside restaurant where our chefs will take you on a culinary journey to the Mediterranean. Savour dishes made from local, freshly-caught seafood influenced by North African flavours and enjoy a unique ambiance of soothing music and stunning views.\n\nOpening Hours:\nSunday - Thursday\nDinner: 6.00 pm - 11.30 pm\nBar: 6.00 pm - 1.00 am\n\nThursday - Saturday\nLunch: 12.00 pm - 3.30 pm\nDinner: 6.00 pm - 11.30 pm\nBar: 6.00 pm - 1.00 am','10th Street','Al Zahiyah Area','',2,1,'026979011',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 18:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:18:03.379053','admin@techtranz.com','2020-01-18 16:48:39.323298',166,2,NULL,'Trader Vic\'s','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nImmerse yourself in island life where the cuisine is exotic, drinks are tropical, and the atmosphere is electric at Trader Vic’s, our French-Polynesian restaurant and bar that promises fun and flair. Sample a tantalising mix of French, Creole and Chinese flavours influenced by these beautiful islands while you listen to Cuban rhythms that will get you in the mood for some post-meal dancing. With lively songs and an upbeat atmosphere, do not be surprised if your evening extends into the early hours of the following day.\n\nOpening Hours:\nSaturday - Wednesday\nDinner: 6.00 pm - 11.30 pm\nBar: 5.00 pm - 2.00 am\n\nThursday - Friday\nDinner: 6.00 pm - 11.30 pm\nBar: 5.00 pm - 3.00 am','10th Street','Al Zahiyah Area','',2,1,'026979011',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 18:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:19:15.275335','admin@techtranz.com','2020-01-18 16:48:51.528222',167,2,NULL,'Al Shorfa Lounge','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe hip and chic Al Shorfa Lounge is the place to meet friends and family for great food and drinks or to enjoy some traditional shisha while you watch the world go by. Sit back, relax and sample sharing plates of Levant specialities or a selection of popular international dishes at this trendy urban venue with an outdoor terrace unlike any other in the city.','10th Street','Al Zahiyah Area','',2,1,'026979129',NULL,'54.3838496','24.4945298',4,164,'2019-11-21 10:30:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:20:14.275289','admin@techtranz.com','2020-01-18 16:49:23.350838',168,2,NULL,'Prego\'s','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFor Italian cuisine just like mamma made and a warm and inviting family-friendly atmosphere that envelops you from the moment you walk in, Prego’s is an eatery with energy, surprising you with fresh flavours, hearty cuisine and genuine hospitality. \n\nOur pasta is freshly made on a daily basis, our pizzas are baked in a traditional wood-fired oven and our chefs do their utmost to delight guests with a little touch of Italy in their selection of authentic dishes and ingredients. \n\nTheatrical open kitchens and a stylish and contemporary design employing a creative use of lights and mosaic tiles add to this venue’s appeal, while the outdoor terrace is immensely popular with diners who enjoy inspiring views of the hotel’s beach and gardens. Spirited, welcoming and accessible, Prego’s is extremely popular with diners.\n\nOpening Hours:\n12.00 pm - 11.30 pm','10th Street','Al Zahiyah Area','',2,1,'026979011',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 12:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:21:19.994540','admin@techtranz.com','2020-01-18 16:49:49.352674',169,2,NULL,'Brauhaus','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFor a dining experience with a difference, head to Brauhaus, Abu Dhabi’s original German restaurant, serving authentic cuisine and refreshing draft hops including Warsteiner, Krombacher, Beck\'s, Paulaner and Bitburger.\n\nChoose from a menu of rustic dishes from across Germany that will satisfy meat lovers and vegetarians in equal measures. Dine in our beer garden with a trickling stream and stunning views from the terrace or enjoy the warmth of the cosy bar and indoor dining area with dark wooden interiors and a lively atmosphere. Spend a relaxed night with colleagues or friends in this effervescent venue where there is never a dull moment. \n\nOpening Hours:\nBar: 12.00 pm - 2.00 am\nRestaurant: 12.00 pm – 11.30 pm','10th Street','Al Zahiyah Area','',2,1,'026979011',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 12:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:22:02.732591','admin@techtranz.com','2020-01-18 16:50:18.525312',170,2,NULL,'Rodeo Grill','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExperience the true ‘art of steakmanship’ at Abu Dhabi’s most sought-after steakhouse, Rodeo Grill, a venue that offers the finest grills and exudes contemporary elegance from the moment you walk through the door.\n\nOur chefs have carefully selected the finest and freshest ingredients, from prime aged beef to freshly-caught seafood and shellfish, which are then cooked to perfection in our signature Josper wood-fired oven. With warm grey timber floors and walls creating a soothing and sophisticated ambiance, this modern steakhouse promises a memorable contemporary dining experience in the heart of the city.\n\nOpening Hours:\n6.00 pm - 11.30 pm','10th Street','Al Zahiyah Area','',2,1,'026979126',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 18:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:22:56.205605','admin@techtranz.com','2020-01-18 16:50:33.184145',171,2,NULL,'Benihana','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nIt’s showtime at Benihana, a contemporary American-Japanese restaurant where you can experience the culinary drama and charm of live Teppanyaki cooking and an irresistible showcase of sushi, sashimi, makimono, steaks, seafood, chicken and fresh vegetables.\n\nConsidered one of the UAE capital’s top dining destinations with an ‘in-the-round’ seating arrangement that enhances the theatrical ambiance, Benihana guarantees entertainment for the whole family.\n\nOpening Hours:\n6.00 pm - 11.30 pm','10th Street','Al Zahiyah Area','',2,1,'026979011',NULL,'54.3838496','24.4945298',1,164,'2019-11-21 18:00:00.000000','2019-11-21 23:30:00.000000','ChIJk9Owd1FmXj4RjsvTFRagkiE',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:24:00.470493','admin@techtranz.com','2020-01-18 16:50:57.202545',172,2,NULL,'Indigo','COVID Notice: Due to limited 