the alluring Abu Dhabi Corniche. The Abu Dhabi Suite, high on the skybridge between the two Nation Towers immerses guests with an astonishing 360◦ view. A signature St. Regis Butler Service is complimentary for every guest in the hotel.\n\nSavor the finest flavors from the region and experience a fresh perspective on international cuisine at The Terrace on the Corniche. Villa Toscana serves traditionally rustic and authentic Italian cuisine from Tuscany. The St. Regis Bar offer a lively ambiance perfect for after a busy day. Azura Panoramic Lounge is the only alfresco hotspot overlooks the glistening Arabic Gulf and Abu Dhabi Corniche. Cabana Beach Bar & Grill offers a delectable menu of crisp salads, hearty burgers and fresh paninis throughout the day with refreshing cocktails.\n\nThe Nation Riviera Beach Club is accessible via a private, air-conditioned, marble underpass that runs below the Corniche. Nation Riviera features a 183 m private beach, secluded cabanas, a spacious infinity pool complete with gardens and a swim-up pool bar as well as exclusive fitness facilities. Treasure Island Children’s Club, is designed as a playful pirate’s ship and provides a safe and enjoyable area for children, with fully supervised indoor and outdoor activities including a pool and water slide.\n\nRemède Spa creates a sanctuary for guests and an experience which borders on mystical.\n\nAbu Dhabi Mall is a 10-minutes drive from The St. Regis Abu Dhabi. The hotel offers free WiFi in all areas along with free valet parking.','Nation Towers','Corniche','',2,1,'026944444',NULL,'54.3280361','24.4638014',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJfStroutlXj4RXCTqMBSHW_c',_binary '',0,0,1),(1,'admin@techtranz.com','2019-11-20 12:38:29.141798','admin@techtranz.com','2020-01-18 16:57:06.597944',181,2,NULL,'The Terrace on the Corniche','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe Terrace on the Corniche is The St. Regis Abu D