iera Beach Club, a haven of wellness and recreation. Nation Riviera features a 200-meter private beach, secluded cabanas, a spacious infinity pool complete with gardens and a swim-up pool bar as well as exclusive fitness facilities.\n \nYounger guests will take joy at the Treasure Island Children’s Club, which is designed as a mock pirate’s ship and provides a safe and enjoyable area for children, with fully-supervised indoor and outdoor activities including a pool and water slide.\n \nNation Riviera Beach Club is accessible via a private, air-conditioned, marble underpass that runs below the Corniche.\n\nFlanked by its own 200 meter stretch of pristine beach, overlooking the turquoise waters of the Arabian Gulf, Nation Riviera Beach Club boasts an array of health and recreational services.','Nation Towers','Corniche','',2,1,'026944780',NULL,'54.3280361','24.4638014',7,180,'2019-11-21 08:00:00.000000','2019-11-21 20:00:00.000000','ChIJfStroutlXj4RXCTqMBSHW_c',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 12:50:28.074119','admin@techtranz.com','2020-09-24 09:42:53.313507',193,1,NULL,'InterContinental Abu Dhabi','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLocated at the heart of the capital, InterContinental Abu Dhabi is located on the beach and a 10-minute drive from bustling downtown. It is 20 minutes by car from Abu Dhabi International Exhibition Center.\n\nRooms at the InterContinental Abu Dhabi are designed with modern interiors and luxurious furnishings, complimented by lavish marble bathrooms. All rooms have views over the city skyline or the Arabian Gulf.\n\nInterContinental Abu Dhabi is home to some of the city\'s best dining experiences. Enjoy succulent Brazilian cuts of meat at Chamas Churrascaria, authentic Lebanese specialties at Byblos Sur Mer, Italian family fare at Circo, old-world favorites at Belgian Cafe, pan-Asian flavors at Cho Gao Marina Walk and fresh seafood with a Thai twist at the award-winning Fishmarket. Enjoy a variety of wines, cocktails and coffee at the Piano Lounge. The all-day dining restaurant Selections serves breakfast, lunch and dinner with the perfect view of beach and marina from almost every table.\n\nThe InterContinental Abu Dhabi has its own private marina. Additional leisure facilities at the hotel include a large swimming pool with sun terrace and a state-of-the-art gym. The concierge can arrange tours for guests.\n\nGuests can enjoy a shopping experience at the Gold Souk, Heritage Village and the Cultural Foundation.There are also a number of top shopping malls within easy reach.','King Abdullah Bin Abdulaziz Al Saud Street','Abu Dhabi','',2,1,'026666888',NULL,'54.329094','24.457232',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJdeU-c_JlXj4Rki8SWllWktw',_binary '',0,0,2),(1,'admin@techtranz.com','2019-11-20 13:02:01.541720','admin@techtranz.com','2020-01-30 20:28:58.649119',194,2,NULL,'Belgian Café','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nBelgium is famous for steaming mussel pots, chunky frites and a variety of Pork dishes; This is the DNA of the Belgian Café.  A choice of exclusive Belgian draught beers and a global collection of beers in a classically European setting with an extensive menu. The Belgian Café is a little piece of old Brussels right in the heart of Abu Dhabi.\n\nDuring the cooler months of the year, it transforms into a huge Beer Garden. For sports lovers, all major games are shown on the big screen. Live music is also played supported by our resident DJ playing music to reminisce and Chill-Out too.','King Abdullah Bin Abdulaziz Al Saud Street','','',2,1,'0507235441',NULL,'54.329094','24.457232',1,193,'2019-11-21 16:00:00.000000','2019-11-21 01:00:00.000000','ChIJdeU-c_JlXj4Rki8SWllWktw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 13:03:23.258168','admin@techtranz.com','2020-01-30 20:29:24.117062',195,2,NULL,'Byblos Sur Mer','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe award-winning Byblos Sur Mer is one of Abu Dhabi’s most celebrated Lebanese restaurants. Enjoy authentic grilled meats and mezze platters in a contemporary, two-level dining room. Guests rave about the Byblos Sur Mer, from the stylish décor to the live entertainment. From the terrace, views of the sparkling marina are best enjoyed with a chilled glass of arak in hand and the chalky smoke of a shisha wafting through the air.  \n\nRestaurant Opening Hours: Saturday to Wednesday - 12:30 to 01:30 / Thursday & Friday - 12:30 to  03:00\n\nUpper Lounge Opening Hours: Saturday to Wednesday - 16:00 to 01:30 / Thursday & Friday - 16:00 to 03.00\n\nLower Lounge ( Grass Area ) Opening Hours: Saturday to Wednesday - 16:00 to 01:30 / Thursday & Friday - 16:00 to 03.00\n\nDress Code: Smart Casual\n\nFor Reservations: Call 800 423 463 or 050 721 1079','King Abdullah Bin Abdulaziz Al Saud Street','','',2,1,'0800423463',NULL,'54.329094','24.457232',1,193,'2019-11-21 12:30:00.000000','2019-11-21 01:30:00.000000','ChIJdeU-c_JlXj4Rki8SWllWktw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 13:04:25.066258','admin@techtranz.com','2020-01-30 20:29:37.312645',196,2,NULL,'Cahamas Churrascaria & Bar','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nAbu Dhabi’s first authentic churrascaria, Chamas buzzes with Brazilian energy and vitality. You’ll enjoy succulent cuts of barbecued meat served straight from the skewer in genuine Pampas fashion. Once Chamas’s all-you-can-eat selection has you feeling full, head to the upstairs bar to sip a caipirinha and savour the marina views.\n\nRestaurant Opening Hours: Daily 18:00 to 00:00\n\nBar Opening Hours: Daily 16:00 to 02:00\n\nDress Code: Smart Casual\n\nFor Reservations: Call 800 423 463 or 056 791 9726','King Abdullah Bin Abdulaziz Al Saud Street','','',2,1,'026666888',NULL,'54.329094','24.457232',1,193,'2019-11-21 18:00:00.000000','2019-11-21 