arlton Ras Al Khaimah, Al Wadi Desert','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExperience world-class service at The Ritz-Carlton Ras Al Khaimah, Al Wadi Desert\nOne of our top picks in Ras al Khaimah.\nWithin the sanctuary of a protected nature reserve, The Ritz-Carlton Ras Al Khaimah, Al Wadi Desert is a unique remote getaway just 45 minutes from Dubai. Ideal for families and travelers seeking a remote getaway, the private resort offers adventure and tranquility combined in a tranquil desert oasis. Intimate pool villas, world-class destination dining, an award-winning hydrotherapy spa and an extensive range of family-friendly and outdoor activities add a luxurious touch to a traditional desert experience. Desert explorers and affluent travelers alike appreciate the beautiful surroundings and immersion in the traditional Bedouin lifestyle while still enjoying creature comforts.\n\nEach one of the 101 villas feature a private pool and deck terrace complete with sun loungers, spacious bedroom and cozy seating area, fully-stocked mini bar and tea/coffee maker, spacious bathroom with luxury Asprey® amenities, complimentary WiFi and LCD TV.\n\nAn award-winning well-being experience awaits at Ritz-Carlton Al Wadi Desert, featuring the region’s only Rainforest circuit and a range of Asian-inspired treatments for a journey complementing serenity and tranquility. Hydrotherapy facilities and a fitness club are available for guests and visitors.\n\n2 restaurants and 1 bar-lounge highlight the best of local and international cuisine in a stylish environment. From a private dinner on the dunes under the starry sky or at the top of an ancient watchtower, to international cuisine at Al Waha or a world class, Indian cuisine at Samar Lounge, The Ritz-Carlton Ras Al Khaimah, Al Wadi Desert enlivens the senses while offering the Taste of Arabia.\n\nConnecting nature and culture is the pinnacle of the 100 hectares nature reserve. Guests at the resort can enjoy a daily falconry show, nature walks, archery and other family-friendly outdoor activities including horse-riding, and encounters with Arabian Oryx, sand and Arabian gazelles, camels, horses, among the wildlife. Kids are entertained at the Ritz Kids Club, featuring an outdoor playground, an expert team at hand, and daily activities such as archery, pony riding, and initiation to the nature, owl interaction and nature walks.',' Al Mazraa','Wadi Khadija','',4,1,'+971 7 206 7777',NULL,'55.834862','25.584713',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJBweO9E_n9T4RGXuxNf5NXaA',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:04:01.947788','admin@techtranz.com','2019-11-21 16:59:24.949473',225,2,NULL,'FARMHOUSE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nOffering guests fresh food from land, air and sea, Farmhouse is a farm restaurant and authentic farm that excels in serving guests seasonal flavors of various dishes. Showcasing a farm to table menu, the eatery allows guests to choose from a range of meats displayed on aging racks and freshly farmed home grown vegetables. Earthy tones, wood, black metal and textured red brick walls all work together to provide a natural open space, setting up the mood for a chic farm dining experience.\n\nIndulge in an exclusive Night Brunch experience every Thursday at Farmhouse, in the magical desert scenery. Bring your loved ones to share an assortment of indulgences, complemented by a live, smooth jazz saxophone performance\n\nEvery Thursday, 6 pm – 11 pm\n\nAED 325 per person, inclusive of the all-new family-style menu and soft beverages\nAED 450 per person, inclusive of the all-new family-style menu and house beverages\nBooking in advance  highly recommended.','Al Mazraa','Wadi Khadija','',4,1,'+971 72067777',NULL,'55.834862','25.584713',1,224,'2019-11-21 18:30:00.000000','2019-11-21 23:00:00.000000','ChIJBweO9E_n9T4RGXuxNf5NXaA',_binary '\0',0,