e at the gleaming desert skies in Moon Bar - the resort’s signature rooftop bar. Vibrant yet mellow, it is the ideal place for sundowners to enjoy the unblemished sunset before gazing at the sparkling night’s sky.\n\nServing snacks and light bites, Moon Bar offers both the seclusion of a lounge setting as well as the choice of relaxed seating for larger groups, to bring together even the closest of friends and family.\n\nOpening Hours: 5 pm until midnight\nShisha: 5.30 pm to 11.30 pm\nServing: Tapas menu, Beverages, and Shisha\nFor more information or to make a reservation, dial +971 7 206 7777 or email rc.rktrw.restaurant.reservations@ritzcarlton.com.','Al Mazraa','Wadi Khadija','',4,1,'+971 7 206 7777',NULL,'55.834862','25.584713',4,224,'2019-11-21 17:00:00.000000','2019-11-21 00:00:00.000000','ChIJBweO9E_n9T4RGXuxNf5NXaA',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:07:42.898500','admin@techtranz.com','2019-11-21 17:03:13.917719',229,2,NULL,'KAN ZAMAN','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nJoin our Arabic BBQ under the stars, every Friday at Kan Zaman, in an outdoor relaxing traditional seating, overlooking the desert landscape. Enjoy live barbecue grill stations, a selection of mezze, salads, and desserts complemented by a lively belly dance performance.\n\n\nEvery Friday, 7 p.m. – 10:30 p.m.\n\nAED230 per person, inclusive of soft beverages\nAED330 per person, inclusive of house beverages\n\n*Advance reservations recommended. Subject to weather conditions.\n\nFor more information or to make a reservation: +971 7 206 7777 | rc.rktrw.restaurant.reservations@ritzcarlton.com.','Al Mazraa','Wadi Khadija','',4,1,'+971 7 206 7777',NULL,'55.834862','25.584713',1,224,'2019-11-21 19:00:00.000000','2019-11-21 22:30:00.000000','ChIJBweO9E_n9T4RGXuxNf5NXaA',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:11:15.717746','admin@techtranz.com','2019-11-21 17:05:46.320750',232,2,NULL,'RITZ KIDS CLUB','COVID