or unique pool deck dining experiences.\n\nOverlooking the resort’s infinity pool, Shore House offers healthy renditions of international cuisine complemented by seafood specialties. The Shore House Bar serves refreshing beverages by the pool, or exclusive signature cocktails on the deck. In villa dining is available 24 hours.\n\nThe Ritz-Carlton Spa at Al Hamra Beach offers world-class wellbeing experience, with four private spa pavilions welcoming guests with a range of island-inspired treatments for a journey complementing serenity and tranquility.\n\nTo enjoy an energizing workout, guests can make use of the dual-space gym. A myriad of activities such as snorkeling, kayak, stand-up paddling, or beach volleyball can be arranged by the resort. The staff can arrange local excursions and motorized watersports in a nearby area as well. The resort’s signature Ritz Kids programme includes a selection of fun and educative activities with a focus on marine life discovery and environment awareness.\n\nDubai International Airport is a 45-minute drive from The Ritz-Carlton Ras Al Khaimah, Al Hamra Beach. Complimentary private parking is possible on site.\n\nAl Hamra Village is a great choice for travellers interested in sandy beaches, beaches and beach walks.',' Vienna Street Al Hamra','Al Hamra Village','',4,1,' +971 7 204 8888',NULL,'55.7772154','25.6902883',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJq6qqqkcK9j4RLbUDT2jj8cI',_binary '\0',0,0,1),(1,'admin@techtranz.com','2019-11-20 14:16:03.115739','admin@techtranz.com','2019-11-21 16:53:09.315652',234,2,NULL,'SHORE HOUSE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe Arabian Gulf is the focal point at Shore House restaurant near Dubai. Indoor and outdoor tables overlook the white sands and shimmering sea, décor reflects a sophisticated maritime theme and the menu showcases grilled dishes and fresh, locally sourced seafood. Fridays feature a lavish brunch of international and local dishes. At sunset, the poolside bar and lounge is a sought-after setting.\n\nHours\nDaily 7 a.m. to midnight; Barefoot Brunch 1 to 4 p.m.\n\nLearn More about Barefoot Brunch.  \n\nFor more information or to make a reservation: +971 7 204 8888 | rc.rktrz.restaurant.reservations@ritzcarlton.com',' Vienna Street Al Hamra','Al Hamra Village','',4,1,' +971 7 204 8888',NULL,'55.7772154','25.6902883',1,233,'2019-11-21 07:00:00.000000','2019-11-21 00:00:00.000000','ChIJq6qqqkcK9j4RLbUDT2jj8cI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:17:03.312892','admin@techtranz.com','2019-11-21 16:55:17.876886',235,2,NULL,'REJUVENATE WITH NATURE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nBalance is easily restored at The Ritz-Carlton Spa, Al Hamra Beach near Dubai, where an uninterrupted view and the soothing sounds of the Arabian Gulf incite a sense of peace upon arrival. Private, waterside pavilions are the setting for locally inspired treatments prepared with flowers, native spices and other natural ingredients and facials harnessing the strength of products from luxury brands ESPA and Natura Bissé. Spa guests also enjoy access to the hotel\'s well-equipped fitness center, open 24 hours a day.\n\nReserve a Treatment\n\nFor more information or to reserve a treatment, please contact the spa at +971 72048888, ext. 5704 or rc.rktrz.spa@ritzcarlton.com.\n\nSpa Hours of Operation:\nDaily 9 a.m. to 8 p.m.; treatments 11 a.m. to 8 p.m.',' Vienna Street Al Hamra','Al Hamra Village','',4,1,'+971 72048888',NULL,'55.7772154','25.6902883',5,233,'2019-11-21 09:00:00.000000','2019-11-21 20:00:00.000000','ChIJq6qqqkcK9j4RLbUDT2jj8cI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:18:23.586900','admin@techtranz.com','2019-11-21 16:55:57.671451',236,2,NULL,'RITZ KIDS','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nYoung travelers carry an innate curiosity and excitement wherever they go. With the resort’s Ritz Kids® program, guests ages 4 and older are immersed in adventure and education with activities that expose them to the natural wonders and cultural traditions of Ras Al Khaimah.',' Vienna Street Al Hamra','Al Hamra Village','',4,1,'+971 7204 8888',NULL,'55.7772154','25.6902883',6,233,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJq6qqqkcK9j4RLbUDT2jj8cI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:19:51.630106','admin@techtranz.com','2019-12-20 07:29:13.335160',237,1,NULL,'The Ritz-Carlton, Dubai Financial Centre','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWithin the United Arab Emirates’ most extravagant city, The Ritz-Carlton, Dubai International Financial Centre embodies modern luxury. Discover a world of superlatives within this Art Deco-inspired hotel, from the biggest ballroom on Sheikh Zayed Road, to an impressive fine art collection. Dubai’s legendary attractions are just moments away, but you may be tempted to stay in and enjoy the acclaimed cuisine and spa treatments.','Gate Village','DIFC Dubai','P.O. Box 48203',1,1,'+971 4 372 2222',NULL,'55.2793989','25.2125165',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:24:19.939982','admin@techtranz.com','2019-12-11 13:59:13.586539',238,2,NULL,'CAFÉ BELGE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWith its Art Deco design and traditional Belgian cuisine, Café Belge at The Ritz-Carlton, Dubai International Financial Centre transports visitors to the golden era of 1920s Brussels. Take a seat at a cafe table and indulge in fresh seafood and beloved Belgian dishes, all crafted with the finest ingredients. To round out your visit, ask the beer sommelier for a recommendation. The restaurant carries a selection of Belgium’s finest beers.\n','Gate Village',' DIFC Dubai','',1,