écor is stylish and contemporary, and our ladies and gentlemen friendly and relaxed, creating a welcoming ambiance and a memorable dining experience for guests, both inside the restaurant and outside on the spacious terrace.\n\nCara is also available for group bookings and private events in the evenings, accommodating up to 115 guests indoors, and 52 outdoors.','Gate Village','DIFC Dubai','',1,1,'+971 4 372 2323',NULL,'55.2793989','25.2125165',1,237,'2019-11-21 06:00:00.000000','2019-11-21 15:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:26:52.164411','admin@techtranz.com','2019-12-11 13:59:46.417897',241,2,NULL,'SUNKEN GARDEN','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSunken Garden is a secret sanctuary, a beautiful shaded place in the heart of Dubai. It is an open space with stylish landscaping and calming water features. It is one of DIFC’s best-kept secrets. Serving a selection of delicious, modern Arabic tapas, Sunken Garden is an ideal place to unwind. It is a haven, an oasis where guests can relax with a much-needed refreshing drink and the best shisha in town. From a selection of over 30 flavors of shisha, from traditional favorites such as Double Apple, Grape or Mint, to the more exotic, including Mango Tango, Raspberry Cream or Chocolate Mint.  An assortment of small bites is also served, along with an impressive selection of teas, coffees, cocktails and mocktails.','Gate Village','DIFC Dubai','',1,1,'+971 4 372 2323',NULL,'55.2793989','25.2125165',1,237,'2019-11-21 14:00:00.000000','2019-11-21 04:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:27:52.515538','admin@techtranz.com','2019-12-11 13:59:55.148663',242,2,NULL,'CAKE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nCake is a contemporary patisserie and café with a simple mission: to be all about cake. An elegant menu of cakes, pastries and cookies are handmade by the pastry team each day, using only the freshest, highest quality seasonal ingredients. Teas, coffees, juices, milkshakes, smoothies and a range of fresh sandwiches and salads are also available, with Cake serving breakfast, lunch and of course cakes, around the clock to eat in or takeaway.','Gate Village','DIFC Dubai','',1,1,'+971 4 372 2323',NULL,'55.2793989','25.2125165',1,237,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:28:44.938787','admin@techtranz.com','2019-12-11 14:00:07.747898',243,2,NULL,'FLAIR NO.5','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSpark up your love affair with botanical cocktails, herb-infused drinks and floral-inspired sharing menus, and immerse yourself in our splendid garden space. Be open to discovery with a vast variety of spirits that are home-crafted by a team of green-thumbed mixologists whose philosophy focuses on floral alchemy.\n\nEmbrace the experimental and pair your sharing platter to an exceptional beverage with a variety of fruits, herbs and spices. Escape to a hidden alcove in a pocket of wilderness and enjoy chilled lounge beats from the resident DJ, setting the mood for a night of plant-based tipples.','Gate Village',' DIFC Dubai','',1,1,'+971 4 372 2323',NULL,'55.2793989','25.2125165',1,237,'2019-11-21 17:00:00.000000','2019-11-21 02:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:30:00.267858','admin@techtranz.com','2019-12-11 14:00:15.745139',244,2,NULL,'LOBBY LOUNGE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe focal point of the hotel’s podium level, the Lobby Lounge is adorned with low tables, elegant sofas and sleek tables and chairs, and is highlighted by striking ceiling art designed to look like crystal branches in the moonlight. The Lobby Lounge Terrace overlooks the majestic Port Cochere and the 10-storey waterfall that cascades against the exterior of the hotel. Guests can enjoy light snacks and a wide selection of Champagne, wines, cocktails, mocktails, soft drinks and coffees.','Gate Village','DIFC Dubai','',1,1,'+971 4 372 2323',NULL,'55.2793989','25.2125165',1,237,'2019-11-21 07:00:00.000000','2019-11-21 23:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:34:24.020516','admin@techtranz.com','2019-12-11 13:55:11.750306',248,2,NULL,'FITNESS CENTER','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nRegistered guests enjoy complimentary access to the spacious, light-filled Fitness Center, featuring an array of free weights, weight machines, and cardio equipment with TVs by LIFE FITNESS® equipment. Guests can also enjoy a direct access to the heated indoor swimming pool.\n\nOne-on-one personal training is available to either guide you through an exercise routine or design a personalized program for you to take home and follow on your own. This includes nutritional information and body composition tests to go with the training programs.\n\nPlease call in advance to book a personal training session and for any inquiries +971 4372 2777 or email difcspa@ritzcarlton.com.\n\nOpen 24 hours. Guests 16-17 years of age have access with a parent or legal guardian, or an authorized consent form. Guests 15 years and under, including infants, are not permitted.','Gate Village','DIFC Dubai','',1,1,'+971 4372 2777',NULL,'55.2793989','25.2125165',3,237,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:35:15.836322','admin@techtranz.com','2019-12-11 13:55:21.592117',249,2,NULL,'RITZ KIDS','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nOur Ritz Kids program includes:\n\nA fun Ritz Kids registration area\nA ‘registration form’ for children to complete upon check in\nRitz Kids welcome packet with coloring book and scavenger hunt focused on the Ritz Kids four key pillars: water, land, culture and environmental responsibility.\nWelcome card, toy and food amenity in guest room\nA Ritz Kids menu offered throughout all hotel restaurants, with healthy and local options available','Gate Village','DIFC Dubai','',1,1,'+97143722222',NULL,'55.2793989','25.2125165',6,237,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJj9T1eI5CXz4RsjfdY7PTTS0',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:38:18.549747','admin@techtranz.com','2019-12-24 12:13:54.912091',250,1,NULL,'The Ritz Carlton Jumierah','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSituated on private beachfront along the famous JBR Walk, The Ritz-Carlton offers first class spa facilities and six outdoor swimming pools for adults and children. The lively Dubai Marina is 5 minutes’ stroll from the resort.\n\nThe beautifully appointed rooms and suites are all sea-oriented and have private balconies overlooking the garden and the pool. Every accommodation includes a flat-screen TV, minibar and luxury en-suite bathroom.\n\nAt The Ritz-Carlton Dubai, guests can experience varieties of themed restaurants ranging from flavors of Asia, Arabia and the Mediterranean including the new beach restaurant Palm Grill overlooking the Arabian Gulf.\n\nThe Ritz-Carlton Spa offers a variety of signature treatments and therapies, complemented by a state-of-the-art gym, a swimming pool and a hammam area. The Ritz Kids program offers daily supervised activities for children, including handicrafts and origami workshops, story time, and even cooking activities.\n\nDubai’s Ritz-Carlton is a 15-minute drive from Mall of The Emirates and Emirates Golf Club. Dubai International Airport is 30 km away.\n\nJumeirah Beach Residence is a great choice for travellers interested in beaches, beach walks and relaxation.','Al Mamsha St ','Jumeirah Beach Residence','',1,1,'043994000',NULL,'55.1374758','25.0825838',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:40:38.750221','admin@techtranz.com','2019-12-24 12:08:56.621948',251,2,NULL,'Palm Grill','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe only beachfront restaurant along JBR Beach, Palm Grill offers a stunning view of the Arabian Gulf and the vivid Dubai sunset. The “no shoes” restaurant elevates the al fresco dining experience with a selection of grilled specialties, fresh seafood and island-inspired cocktails. It’s also a popular destination for evening drinks and its Saturday Chill and Grill brunch.\n\nHours:\n\nDaily, 12 noon to 11 p.m.\nSpecial beverage offers available from Sunday to Thursday from 12 noon to 10 p.m.\nSaturday Chill & Grill Brunch from 1 p.m. to 4 p.m.\nFor information on upcoming events and promotions, please visit our Dining Experiences page.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'043186150',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 12:00:00.000000','2019-11-21 23:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:41:37.873068','admin@techtranz.com','2019-12-24 12:09:29.358056',252,2,NULL,'Splendido','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSplendido restaurant at The Walk, JBR is much like Italy itself; effortlessly sophisticated, romantic and inviting. The menu showcases the best of Italian cuisine including homemade pastas, fresh seafood and rich desserts. Curated regional are dishes complemented by bold aperitifs, Italian wine and cocktails. Dine al fresco on the Tuscan-style terrace, amid the summer gardens on the piazza or in the chic, Mediterranean-inspired dining room.\n\nHours: 6 - 11 p.m. \nHappy Hour: 5:30 - 7 p.