es','',1,1,'043186150',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 17:00:00.000000','2019-11-21 00:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:44:15.073562','admin@techtranz.com','2019-12-24 12:11:36.352152',255,2,NULL,'La Baie','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nPerfect for relaxing with friends and mingling with new ones, La Baie is a chic lounge with direct pool access and a view overlooking the Dubai beach. The beach club-inspired setting features a DJ-spun soundtrack on most days and a menu of both bar favorites and lighter fare paired with craft cocktails, international hops and shisha. The lounge is the best place for a post-brunch party and offers private cabanas by the swimming pool, a terrace and indoor seating.\n\nHours: \n12 p.m. to 1 a.m.\nLunch **Food Service from 12 p.m. to 12 a.m.**\nHappy Hour: 4:30 to 6:30 p.m.\n\nFor information on upcoming events and promotions, please visit our Dining Experiences page.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'043186150',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 12:00:00.000000','2019-11-21 01:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:45:09.195698','admin@techtranz.com','2019-11-21 16:30:17.149132',256,2,NULL,'LOBBY LOUNGE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nGlamorous throughout the day, the Lobby Lounge at The Ritz-Carlton Dubai invites guests for delectable treat featuring artisan pastry and cakes selection.\n\nWell-known for its classic afternoon tea, the grand venue offers irresistible cakes, fine pastries, freshly baked scones and an authentic tea experience from around the world.\n\nA perfect venue for social gatherings or intimate celebrations, ladies may lie back and sip their cup of tea while listening to the delicate strokes of the harpist.\n\nExquisitely crafted delicacies, artisanal cakes and fine pastries elegantly displayed in the center counter\nLarge terrace overlooking the Arabian Gulf, The Palm Jumeirah and surrounding gardens\nThe perfect place to unwind and sip in your favorite cup of tea or coffee\nOffers different selection of infusions and brews from around the world\nLearn more about our traditional Afternoon Tea here.\n\nFor reservations, please call +971 4 318 6150 or email dine.dubai@ritzcarlton.com.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'+971 4 318 6150 ',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:46:18.725212','admin@techtranz.com','2019-12-24 12:11:56.070520',257,2,NULL,'Caravan','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nDiscover true flavors from the trade routes that were once traveled by the men of the desert. Caravan offers a collage of flavors, colors and aromas where the exotic taste of India, Arabia and the Mediterranean are celebrated in a single setting.\n\n\nLondon Social Brunch\nEvery Friday, 1 p.m. to 4 p.m.\n\nExperience London’s diversity of cultures and cuisines. Our award-winning brunch is bringing London’s unique food scene to Dubai. Undertake a journey along the London underground stations and discover the taste and flavours of the spices of Banglatown and Little Beirut, as well as British classics as Fish n‘ Chips and Yorkshire Pudding. Enjoy 12 live cooking stations, Britain’s favourite cocktails and beers and a live duo performing old and new British classics.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'043186150',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 07:00:00.000000','2019-11-21 11:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:47:27.208656','admin@techtranz.com','2020-01-05 20:44:36.289049',258,2,NULL,'Lobby Lounge','COVI