he palate with thirst-quencher beverages.\n\nHappy Hours: 4:30 to 6:30 p.m.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'+971 4 399 4000',NULL,'55.1374758','25.0825838',1,250,'2019-11-21 11:00:00.000000','2019-11-21 18:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:52:55.407276','admin@techtranz.com','2019-12-30 03:32:38.646357',264,2,NULL,'Fitness Center - The Ritz Carlton Jumierah','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nDesigned to assist with staying fit or achieving a specific wellness goal, the fitness center at this Dubai hotel features state-of-the-art facilities to create or maintain a healthy routine. Families enjoy access to a full range of amenities, including a gym and six swimming pools, and Dubai locals can enroll in the resort membership program with benefits including savings on spa and dining.\n\nFACILITIES:\n\n\n• 24-hour gym\n• Group exercise and yoga classes\n• Four tennis courts\n• Six swimming pools\n• Private beach\n• Personal trainers for adults and kids\n• TechnoShape using technology to transform the midriff area quickly and effectively','Al Mamsha St','Jumeirah Beach Residences','',1,1,'043994000',NULL,'55.1374758','25.0825838',3,250,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:53:50.432629','admin@techtranz.com','2019-12-24 12:13:13.462405',265,2,NULL,'Ritz Kids','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe innovative Ritz Kids offering at The Ritz-Carlton, Dubai enables young guests to discover Dubai and the other Emirates with their own eyes. The hotel’s family-friendly program features activities based on four concepts – water, land, environmental responsibility and culture which instills in children, fond memories and life-long knowledge. Tailored to resort guests aged four to 12, children enjoy art and crafts, sand castle making and more.','Al Mamsha St','Jumeirah Beach Residences','',1,1,'043994000',NULL,'55.1374758','25.0825838',6,250,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJbz-irawUXz4ReY-nsmG6otQ',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 14:56:00.827077','admin@techtranz.com','2020-07-16 09:54:17.857621',266,1,NULL,'Waldorf Astoria Dubai Palm Jumeirah','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSituated on the iconic Palm Jumeirah island, the Waldorf Astoria Dubai Palm Jumeirah has all the amenities for a relaxing retreat just minutes from the bustle of the city. The resort features a generous 200-metre private soft-sand along with separate temperature-controlled pools for adults and children allowing for both fun and relaxation.\n\nIn addition to the supervised Coco Kids Club, the resort provides numerous leisure activities for the whole family to enjoy. The dedicated Water Sports Centre offers an array of beach activities including scenic boat tours, kayaking, and pedal boating. With a stunning view overlooking the palm, the hotel tennis court has equipment available for rent and lessons with a trained professional available upon prior booking requests.\n\nThe Fitness Centre features Life Fitness cardio and strength training equipment for all fitness levels, accompanied by a variety of group exercise classes including functional training and HIIT sessions.\n\nSpanning over 3,200 square meters, the spa features an extensive array of hydrotherapy facilities and thermal relaxation rooms. With treatments and services inspired by such exotic places as Morocco, France and Asia, the Waldorf Astoria Spa is an ideal oasis to treat the senses.\n\nThe resort boasts the finest cuisine with unparalleled service including a contemporary Italian dining experience at Social by three-Michelin-star Chef Heinz Beck and a Vietnamese culinary journey at LAO. In addition to classic afternoon tea at the iconic Peacock Alley, the international fare is enjoyed at Mezzerie while al fresco Californian dining and sunset cocktails are served in style at Palm Avenue.','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,1),(1,'admin@techtranz.com','2019-11-20 14:59:43.160441','admin@techtranz.com','2020-01-12 12:31:36.644920',267,2,NULL,'Spa - Waldorf Astoria Dubai Palm Jumeirah','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe Waldorf Astoria Spa has been awarded \'Best Luxury Beach Resort\' in the United Arab Emirates at the World Luxury Spa Awards 2018\n\nThe spa features over 3,200 square meters of palatial indoor space with an extensive array of hydrotherapy facilities and thermal relaxation rooms. Inviting warm, golden colors and a classic and refined design will help you unwind. The spa\'s spherical shape reminds us of the continual cycle and journey toward wellbeing while our professional team provides luxurious treatments and services to create a unique experience for you.\n\nThe Waldorf Astoria Spa is an ideal oasis to treat the senses, with journeys inspired by such exotic places as, Morocco, French and Asia. Discover locally inspired rituals as well. Each journey incorporates traditional practices and exquisite products to deliver a memorable and unique experience.\n\nFor more information or to schedule a treatment, kindly call +971 4 818 2222 or email dxbpd.spa@waldorfastoria.com\n\nSpa Facilities:\n\n12 Treatment Rooms\nIce Fountain\n2 Private Couples Suites\nExperience Showers\nWhirlpool Hot Tubs\nThermal and Water Flotation Lounges\nSaunas\nTraditional Arabic Attar Perfumery\nSteam Rooms\nSpa Boutique\nHerbal Steam Rooms\n \nSpa Hours:\n\nOpen daily from 10:00 a.m. - 9:00 p.m.','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',5,266,'2019-11-21 10:00:00.000000','2019-11-21 21:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:07:39.463534','admin@techtranz.com','2019-12-24 12:11:34.882085',268,2,NULL,'Pearl Club','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nPaying homage to the rich history of the UAE pearl diving, The Pearl Club is an exclusive oasis with stunning panoramic views of the Palm Jumeirah and Dubai skyline in a relaxed atmosphere.\n\nLocated on the 5th floor of the luxury hotel, the Pearl Club is a private oasis offering fabulous views and a relaxed yet sophisticated atmosphere. Guests can meet and browse a wide selection of newspapers and magazines, catch up on the latest news or simply relax on the balcony while enjoying the panoramic view of the Palm Jumeirah and Dubai skylines.\n\nThe Pearl Club is one of the most exclusive spaces on the Palm Jumeirah and is available to guests* who have reserved Pearl Club rooms, Pearl Club suites, Waldorf Astoria suites, Chairman\'s Suite or Royal Suite\n\nOpen daily from 7:00 a.m. - 9:30 p.m.\n\nPlease note that the Pearl Club dress code is smart casual from 5:00 p.m. onwards.\n\n*Children of 12 years old and younger are not welcomed at the Pearl Club after 5:00 p.m.\n\nFor more information, call +971 4 818 2222 or email dxbpd.pearlclub@waldorfastoria.com','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 07:00:00.000000','2019-11-21 21:30:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(-1,'admin@techtranz.com','2019-11-20 15:09:27.021921','admin@techtranz.com','2019-12-24 12:12:08.964165',269,2,NULL,' Brunch','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nBrunch season is officially back and Mezzerie is the place to take part in an extraordinary theatrical brunch. Featuring show-stopping dishes, interactive table service, and live entertainment for the whole family. Diners will have an unforgettable Friday with the loved ones. Take a front row seat to the performance of chefs and bartenders serving you some of Waldorf Astoria\'s signature dishes and concoctions. Indulge in a legendary buffet offering all the classic brunch highlights with seafood, sushi and salad stations, and don\'t miss the enticing dessert safari. The afternoon will be complemented with a live guitarist, a live band and a magician to keep you entertained. A truly unforgettable occasion every Friday.\n\nAED 375 inclusive of soft beverage\nAED 495 inclusive of house beverage\n\n','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 13:00:00.000000','2019-11-21 16:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:10:48.645079','admin@techtranz.com','2019-12-24 12:12:39.326093',270,2,NULL,'Social by Heinz Beck','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWorld-renowned, 3-star Michelin Chef Heinz Beck brings contemporary Italian dining to Dubai. Featuring inviting design elements and offering innovative contemporary Italian cuisine, Social by Heinz Beck offers a relaxed yet elegant atmosphere with magnificent views of Dubai, making this an ideal setting for every day dining and special celebratory meals.\n\nHeinz Beck is widely known throughout Italy and Europe as a notable master of modern gastronomy. Expressing a unique interpretation of the modern kitchen, Beck\'s artistry exceeds his raw culinary talent with a well-guarded process, which includes mindfully curating ingredients and implementing innovative techniques to transform simple ingredients into highly evocative dishes. Following the success of the acclaimed La Pergola in Rome, Social by Heinz Beck is set to amplify Chef Beck\'s reputation within Dubai and solidify his position as an international culinary talent.\n\nWe are very proud of Social by Heinz Beck to win Best Italian Restaurant at FACT Dining Awards Dubai 2018 and being \"Highly commended Best Italian Restaurant\" for the Time Out Dubai Restaurant Awards 2016. The Accademia Italiana della Cucina has also awarded Social by Heinz Beck with the Diploma of \"Buona Cucina 2016\".','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 18:30:00.000000','2019-11-21 23:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:12:55.089069','admin@techtranz.com','2019-12-24 12:30:25.301971',271,2,NULL,'LAO','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nTaking its inspiration from the 1st millennium tribe that settled across Southeast Asia, LAO reflects the rich culinary traditions of the LAO people, heavily inspired by the natural beauty and intrinsic cuisine of Vietnam.\n\nLAO aims to elevate traditional Vietnamese cuisine through Chef Mai\'s menu, fusing traditional cooking techniques with modern presentations developing unique flavors and sensory experiences.\n\nLAO creates a truly unforgettable dining experience with both indoor and alfresco seating overlooking the hotel\'s central gardens. A spacious and creatively designed private dining room is available for intimate parties and dinners.','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 18:30:00.000000','2019-11-21 23:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:13:49.487068','admin@techtranz.com','2020-01-11 12:43:39.104104',272,2,NULL,'Mezzerie','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nA luxurious canvas of subtle arabesque details, Mezzerie is Waldorf Astoria Dubai Palm Jumeirah\'s main dining restaurant. An elegant space combining western character with subtle Arabic details, the restaurant is inspired by the spices used in the region. Mezzerie offers breakfast, lunch and dinner buffets featuring international cuisine. Nightly themed dinner buffets feature a rotating selection of international cuisines appealing to guests who enjoy a variety of dishes.\n\n30% Discount on Friday Brunch & Afternoon tea \n\nSunday	|	Mamma Mia\nMonday	|	Around the World\nTuesday	|	Oriental Night\nWednesday	|	La Brasserie\nThursday	|	Arabian Night\nFriday	|	The Butcher\nSaturday	|	Flavours from India\n\nSample Waldorf favorites such as Eggs Benedict, Waldorf salad and the famous Red Velvet cake at this iconic restaurant, created by Oscar Tschirky, the maître d\' who originally defined the concept of epicurean public dining at the Waldorf Astoria Hotel in New York City.\n\nBreakfast	|	6:30 a.m. - 10:30 a.m.\nLunch	|	12:30 p.m. - 3:00 p.m.\nDinner	|	6:30 p.m. - 10:30 p.m.\n\nFor information and reservations, call +971 4 818 2222 or email dxbpd.restaurants@waldorfastoria.com.\n\n\n30% Discount on Friday Brunch','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 06:30:00.000000','2019-11-21 22:30:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:14:55.854079','admin@techtranz.com','2019-12-24 12:14:47.020179',273,2,NULL,'Palm Avenue','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nA poolside oasis located in the heart of the hotel\'s elegant grounds, Palm Avenue offers guests a chic, yet relaxed atmosphere serving inspired Californian comfort food.\n\nEnjoy a selection of Californian inspired dishes; savour signature flat breads, tacos, quesadillas and end your journey with sweets such as Hawaiian vanilla pannacotta or homely baked apple tart.\n\nTransforming into a contemporary dining venue and lounge in evenings, Palm Avenue is perfect for guests to enjoy a variety of refreshing cocktails and shisha whilst taking in the incredible sunset views of the Palm Jumeirah and Dubai skyline.\n\nOpen daily 10:00 a.m. - 11:00 p.m.','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 10:00:00.000000','2019-11-21 23:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:16:19.443534','admin@techtranz.com','2020-01-06 00:37:16.420322',274,2,NULL,'Peacock Alley','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe term \'Peacock Alley\' was coined to portray the daily promenade of notables through the original colonnade connecting The Waldorf and The Astoria hotels in New York City. A tradition that continues today, Peacock Alley is an elegant lounge celebrated as a place \'to see and be seen\'.\n\nA historical piece of New York heritage is now in Dubai. Peacock Alley overlooks the hotel\'s beautiful central gardens and serves the finest teas, coffees and light meals. Guests can enjoy a classic Afternoon Tea and sample the Waldorf Astoria signature tea blend.\n\nEnjoy the temperate weather during the winter months on the palatial Peacock Alley terrace. Take in the stunning evening views of the glittering Dubai skyline whilst sampling a traditional Shisha from 12:00 p.m. - 11:00 p.m.\n\n30% Discount on Afternoon Tea','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',1,266,'2019-11-21 12:00:00.000000','2019-11-21 23:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:17:28.692957','admin@techtranz.com','2020-01-11 12:45:43.805133',275,2,NULL,'Serafina Bar','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExuding a character reminiscent of the Italian Renaissance, Serafina Bar features lush furnishings, striking blown-glass chandeliers and rich experience. With unique cocktails and small dishes inspired by Venetian \'Bacaro\' cuisine, guests are encouraged to watch the sunset below the horizon whilst being serenaded by live entertainment in the evening. A selection of premium spirits and cigars is available to enhance the experience.\n\nPlease note: Serafina Bar is an adults-only venue, welcoming guests aged 21 years or older.','Crescent Road','The Palm Jumeirah','',1,1,'048182222',NULL,'55.1510903','25.1345825',4,266,'2019-11-21 17:00:00.000000','2019-11-21 00:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:18:48.675601','admin@techtranz.com','2020-01-12 12:31:58.713497',276,2,NULL,'Coco\'s Kids Club - Waldorf Astoria Dubai Palm Jumeirah','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe supervised Coco\'s Kids Club welcomes children aged 3 to 12 years old and offers a variety of activities to ensure your children are kept well entertained while you enjoy some time to yourself. Specially crafted activities aimed to entertain specific age groups include, Fun team games arts and crafts sessions, sandcastle building competitions, Musical games face painting, Board games & puzzles plus much more to keep your little ones entertained for hours.\n\nOur trained team members are always on hand to ensure safety while your little ones have fun.\n\n*Children under the age of 3 years must be accompanied by a parent or guardian at all-time in the Kids Club.\n\n*Children 3-12 years must be registered by a parent or guardian over the age of 21 years old before they stay in the kids club under the care of our kids club team. \n\nParents are requested to remain in the hotel while their children play in the Kids Club.\n\nLocated on the ground floor, Coco\'s Kids Club is open from 10:00 a.m. until 7:00 p.m. daily.\n\nFor more information, kindly call +971 4 818 2255 or send email to dxbpd.recreation@waldorfastoria.com','Crescent Road','The Palm Jumeirah','',1,1,'048182255',NULL,'55.1510903','25.1345825',6,266,'2019-11-21 10:00:00.000000','2019-11-21 19:00:00.000000','ChIJ__30xjFrXz4RVhGdvh_K-cw',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:21:13.675705','admin@techtranz.com','2019-11-25 09:37:14.780855',277,1,NULL,'Emerald Palace Kempinski','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSituated on the western crescent of the man-made island, Palm Jumeirah, the Emerald Palace Kempinski Dubai boasts a 500 m private white sand beach, an outdoor swimming pool offering views of the city, and 8 culinary experiences including the miX by 3-Michelin star chef, Alain Ducasse.\n\nThe elegant rooms are air-conditioned and come complete with a flat-screen satellite TV, a seating area and minibar.\n\nAt Emerald Palace Kempinski Dubai guests can indulge in an array of cuisines comprising of Italian, Venetian, Asian and Mediterranean. A scrumptious buffet breakfast is served daily in the Le Jardin restaurant.\n\nThe 3000 square-metre Cinq Mondes Spa features 23 treatment rooms, offering guests a haven to relax and unwind. Here guests can also find a modern state-of-the-art fitness centre and a large indoor lap pool.\n\nFree WiFi is available in public areas and the concierge service may offer guests assistance in booking tours, excursions, as well as special requests.\n\nEmerald Palace Kempinski Dubai is 4 km from Aquaventure Waterpark, 18 km from Mall of the Emirates and 30 km from Burj Khalifa. Dubai International Airport is 40 km from the hotel.\n\nPalm Jumeirah is a great choice for travellers interested in relaxation, beaches and family friendly trips.','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8888',NULL,'55.1098655','25.1107314',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:30:50.244088','admin@techtranz.com','2019-11-21 14:32:54.433695',278,2,NULL,'LE JARDIN','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLe Jardin is the preeminent dining venue at Emerald Palace Kempinski Dubai, which brings to life the stately splendour and enchanting elegance of Europe’s royal gardens. Bask in rich natural light during the day or step onto the large terrace at any moment to take in views of the Palace’s pools and verdant landscapes. Relish an extravagant buffet breakfast and select from a tempting a la carte menu for dinner that is defined by light and healthy creations. This is where European-influenced cuisine meets the rich flavours of Arabia and India – a haven for culinary connoisseurs where signature dishes are never the same on consecutive days\n\nEmail Contact:\nfb.emeraldpalace@kempinski.com\nTelephone:\n+971 4 248 8810\n\nOpening hours:\n \nBreakfast:\nMon - Sun 06:00 - 11:00\nDinner:\nMon 19:00 - 23:30\nThu - Sun 19:00 - 23:30\n\nRestaurant style:\nFine dining\nDress Code:\nSmart Casual, National Dress\nCuisine:\nEuropean\nCapacity:\n184 indoor, 168 outdoor\nSmoking:\nAllowed at the outside areas only','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8810',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 06:00:00.000000','2019-11-21 23:30:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:32:12.512457','admin@techtranz.com','2019-11-21 14:33:45.709630',279,2,NULL,'VILLAMORÉ','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nVillamoré is a laid-back, Mediterranean inspired restaurant and lounge that reflects supreme contemporary comfort, that is sophisticated yet relaxed. The attitude is European, with an understanding of luxury as time and space, offering genuine, bespoke hospitality that extends beyond mere satisfaction to the anticipatory. Guests are welcomed into a sanctuary of minimalist, sublime rustic chic, echoing the natural beauty of the setting with a Mediterranean vernacular with added subtle organic touches.\n\nThe philosophy is interpreted through the culinary philosophy and beverage story, with a modern kitchen inspired by the flavors, textures and ingredients of the Mediterranean with a heavy influence from Italy and the Levant. There is a nod towards the luxury, yet keeping things seasonal, local and sustainable where possible.\n\nBy day, the venue is bright and breezy, perfect for a chilled lunch with rose and top quality, seasonal and fresh meats and fish, enjoyed al fresco or on the upper lounge deck. Upon sunset, the vibe switches it up a notch, with nightfall bringing a change of playlist, switching from chilled tunes to lounge music from the DJ team.\n\nWorking hours: 12:00 - Late\n\nReservation@villamoredubai.com\nTelephone:\n+971 4 248 8890\n\n\nDress Code:\nSmart Casual\nCuisine:\nSeafood\nCapacity:\n62 indoor, 234 outdoor\nSmoking:\nAllowed at the outside areas only','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8890',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 00:00:00.000000','2019-11-21 02:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:33:16.214253','admin@techtranz.com','2019-11-21 14:34:21.229401',280,2,NULL,'MATAGI','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nMatagi is a stylish, contemporary Asian dining destination obsessed with sourcing the highest quality meat. Set in an enchanting but intimate venue, the extensive menu of exquisite Japanese cuisine and East meets West drinks list makes Matagi one of Dubai’s leading dining destinations.\n\nHappy hour: 18:00 - 20:00\n\nWorking hours: 12:00 - Late\n\n\n\nEmail Contact:\n Reservation@matagidubai.com\nTelephone:\n+971 4 248 8850\n\n\nRestaurant style:\nÀ la carte\nDress Code:\nSmart Casual\nCuisine:\nPan Asian\nCapacity:\n111 seats\nSmoking:\nNo','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8850',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 00:00:00.000000','2019-11-21 02:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:34:02.328092','admin@techtranz.com','2019-11-21 14:35:31.729719',281,2,NULL,'ALL’ONDA','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nDeveloped in partnership with the renowned chef Chris Jaeckle, the menu takes a fresh modern approach to traditional Italian food. Inspired by Venetian cuisine, which over the centuries was at the epicenter of the trade routes between east and west, diners can expect Asian and near Asian influences combined with Italian culinary traditions.\n\nExpect masterful, beautifully served dishes within a contemporary setting. all’onda features Venetian cichetti, crudos, risottos, handmade pastas, and a variety of other dishes, but don’t be surprised to find Japanese and Indian influences in these offerings.\n\nPerfect for product launches, brand activations and weddings, feel free to contact our events team for further information.\n\nFor events: events@allondadxb.com\n\nPlease be informed that during the summer the restaurant will be closed on Monday.\n\n\n\nEmail Contact:\nreservations@allondadxb.com\nTelephone:\n+971 4 248 8870\n\nOpening hours:\n \nBrunch:\nFri 13:00 - 17:00\nDinner:\nTue - Wed 17:00 - 01:00\nThu - Fri 17:00 - 02:00\nSat - Sun 17:00 - 01:00\n\nRestaurant style:\nÀ la carte\nDress Code:\nSmart Casual\nCuisine:\nVenetian, Japanese\nCapacity:\n102 indoor, 226 on terrace\nSmoking:\nYes','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8870',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 13:00:00.000000','2019-11-21 01:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:34:54.019757','admin@techtranz.com','2019-11-21 14:36:35.342722',282,2,NULL,'MIX BY ALAIN DUCASSE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nAn impressive and stunningly beautiful place to dine, both in the setting and food presentation, miX by Alain Ducasse pays tribute to the local produce. The first restaurant of the famous chef in the United Arab Emirates and also the largest in his restaurant group, it is perfectly zoned to create the most welcoming atmosphere.\n\nSpread over three floors, guests have an option to enjoy al fresco dining on the sixth floor rooftop, surrounded by magnificent views of the sea and The Palm Jumeirah. The true jewel is the private chef’s table hidden from view in the central dome of the Palace, where only a privileged few can ascend in a private elevator.\n\nWith contemporary and classical French influences, miX by Alain Ducasse features a well-rounded menu that changes according to seasons. Guests can enjoy refined cuisine paired with rare labels in the most iconic setting.\n\nFor any enquiry or exclusive hire, our events team will be happy to guide you through the beginning to the end of your event. Our goal is truly to surpass all your expectations and ensure your event is a success.\n\nFor events: events@mix-dubai.com\n\n\n\nEmail Contact:\nReservations@mix-dubai.com\nTelephone:\n+971 4 248 8860\n\nOpening hours:\n \nBrunch:\nFri 13:00 - 17:00\n\nRestaurant style:\nTapas\nDress Code:\nSmart Casual\nCuisine:\nFrench\nCapacity:\n308 indoor, 217 outdoor\nSmoking:\nYes\n','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8860',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 13:00:00.000000','2019-11-21 17:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:36:51.792246','admin@techtranz.com','2019-11-21 14:37:13.709202',283,2,NULL,'SKORPEUS','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nGet a taste of the urban boho-chic lifestyle as you gather with loved ones at this vivacious lounge and bar. Immerse in the free-spirited ambience of this refreshing bar as you gather during the day or after dusk. Serving classics prepared by brilliant mixologists, this saloon has all the makings of a splendid time out.\n\nWorking hours: 18:00 - Late\n\n\n\nEmail Contact:\nReservation@skorpeusdubai.com\nTelephone:\n+971 4 248 8840\n\n\nRestaurant style:\nBar, Lounge\nDress Code:\nSmart Casual\nCuisine:\nContemporary European\nCapacity:\n148 seats\nSmoking:\nYes','Crescent West',' Palm Jumeirah','',1,1,'+971 4 248 8840',NULL,'55.1098655','25.1107314',4,277,'2019-11-21 18:00:00.000000','2019-11-21 02:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:37:42.807018','admin@techtranz.com','2019-11-21 14:50:10.959396',284,2,NULL,'SABLANC','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSablanc invites you to unwind in a calming ambience inspired by 1960’s French Riviera. Perfectly placed by the main pool and beachfront, it presents a laidback charm created for those who appreciate sophisticated simplicity. Choose from a wide selection of signature cocktails, mocktails, infused waters, botanical beverages and refreshing fruits drinks. An elevated luxurious experience is delivered when you reserve a private cabana and order from the crafted Picnic Hamper Collection. Alternatively, explore other creations primed for the pool and which includes attractions ranging from Sablanc signature \'minis\' to artisan ice cream, and a list of Chef-crafted special dishes that change daily.\n\nEmail Contact:\nfb.emeraldpalace@kempinski.com\nTelephone:\n\nOpening hours:\n \nBar:\nMon - Sun 09:00 - 19:00\n\nRestaurant style:\nSnack Bar, Pool Bar\nDress Code:\nSwimwear\nCuisine:\nInternational\nCapacity:\n132 seats\nSmoking:\nAllowed at the outside areas only','Crescent West','Palm Jumeirah','',1,1,'+971 2488888',NULL,'55.1098655','25.1107314',4,277,'2019-11-21 09:00:00.000000','2019-11-21 19:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:38:31.573602','admin@techtranz.com','2019-11-21 14:50:47.619089',285,2,NULL,'BLÜTHNER HAL','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nBlüthner Hall presents a regal ambience that is designed with care for exquisite epicurean experiences. Located at the heart of Emerald Palace Kempinski Dubai, it hosts the finest elements that pay homage to the palaces of 18th century Europe. Shimmering with gold leaf platted surfaces and unparalleled vistas of the Dubai Skyline, here lies a venue of privilege for modern-day aristocracy. Allow the aura of the central masterpiece – a Blüthner Grand Piano – set the tone of your visit as you prepare to savour excellence in servings of signature themed high teas, Caviar & Champagne, globally-sourced premium spirits and crafted cuisine.\n\n\n\nEmail Contact:\nfb.emeraldpalace@kempinski.com\nTelephone:\n+971 4 248 8820\n\nOpening hours:\n \nAll day dining:\nMon - Sun 00:00 - 00:00\n\nRestaurant style:\nLobby Lounge\nDress Code:\nSmart Casual\nCuisine:\nEuropean\nCapacity:\n84 indoor, 82 outdoor\nSmoking:\nAllowed at the terrace only','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8820',NULL,'55.1098655','25.1107314',1,277,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:40:59.389913','admin@techtranz.com','2019-11-21 14:53:21.179450',286,2,NULL,'INDOOR POOL','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLeave your cares behind as you dip into our indoor swimming pool – 22.5 m long and 1.35 m deep, the largest of its kind in the city. The perfect place to unwind and escape the heat, while enjoying a variety of refreshing herbal teas, smoothies, boosters, shakes and more from our poolside Vitamin Bar. Cosy lounge chairs and cabanas surround the pool, inviting you to relax poolside between a dip, a swim or session in the sauna.','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8888',NULL,'55.1098655','25.1107314',2,277,'2019-11-21 06:00:00.000000','2019-11-21 22:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:41:32.159066','admin@techtranz.com','2019-11-21 14:54:01.149184',287,2,NULL,'OUTDOOR POOL','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSoak in the views of a stunning Dubai city skyline from the Palace\'s outdoor pool while you wallow in the shallow with 1.2 m depth or swim 60 m towards the opposite end that is 1.4 m deep. Your little ones can safely cool down at the 0.4 m deep Circular Pool for kids, which is perfectly positioned near the Sablanc pool bar where you can relish light bites along with refreshing beverages. A range of amenities are offered throughout the day, from lollies to face mist, frozen treats and cold towels, with our compliments. Gaze into the horizon and unwind, as the tranquillity of this urban oasis sweeps over you.','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8888',NULL,'55.1098655','25.1107314',2,277,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:42:20.111411','admin@techtranz.com','2019-11-21 14:55:13.955147',288,2,NULL,'KIDS AND TEENS CLUB','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWe pay special attention to our younger guests during their stay with us. For them we have designed a unique destination to learn new skills, make new friends and enjoy hours of playtime at Little Kingdom Kid\'s Club and our Teens Club. With a huge selection of fun-filled activities on offer including arts and crafts, sports, PlayStation and Nintendo Wii, puzzles, face painting, and so much more, you can be sure they will have a memorable time.\n\nThe Kids Club welcomes children between the ages of 3 and 12.\nTimings: 9:00 to 20:00\nLocated on the ground level\n\nThe Teens Club welcomes teens from the ages of 12 to 17.\nTimings: 9:00 to 22:00 \nLocated on Level 1','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8888',NULL,'55.1098655','25.1107314',6,277,'2019-11-21 09:00:00.000000','2019-11-21 22:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:42:52.753179','admin@techtranz.com','2019-11-21 14:55:49.759133',289,2,NULL,'FITNESS CENTRE','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nKeep up with your fitness schedule at our 24 hour, state-of-the-art gym with Technogym equipment. Facilities include a yoga studio with an instructor; professional personal trainers and a healthy lifestyle café serving protein and detox drinks as well as nutritious snacks. Continue the active lifestyle by taking a dip in the indoor wellness pool or enjoy a leisurely walk through the lush lawns.','Crescent West','Palm Jumeirah','',1,1,'+971 4 248 8888',NULL,'55.1098655','25.1107314',3,277,'2019-11-21 00:00:00.000000','2019-11-21 00:00:00.000000','ChIJzYbEA-IUXz4RjxquK89vtkU',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:49:47.660110','admin@techtranz.com','2020-07-16 09:53:38.164700',290,1,NULL,'Jumeirah Mina A\'Salam','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nCompletely refurbished in 2015, Jumeirah Mina A’Salam, the heart of Madinat Jumeirah Resort, is a luxuriously charming boutique style hotel. The spacious guest rooms are beautifully furnished, with private balconies overlooking the sea, offering authentic Arabian experiences on a beach front location with family friendly service.\n\nMeaning \'Harbour of Peace\', the hotel forms the gateway to Madinat Jumeirah. It’s the entry point from which numerous waterways and walkways thread their way to all corners of Madinat Jumeirah. Following these will transport you and on this tour you’ll see just how much is on offer – and why this luxury resort is the jewel of Dubai.\n\nMadinat Jumeirah isn’t just a place to stay. It’s a place full of experiences to try and memories to share. The property has something special for every member of the family here. With world class golf, Sinbad’s Kids Club, the onsite Madinat Theatre, Madinat Jumeirah’s own private beach, the Talise Spa and watersports, tennis and luxury yachts.\n\nThere’s only one thing more remarkable than the quality of the eating and drinking at Madinat Jumeirah – and that’s the sheer variety of it. With over 40 world-class restaurants, bars and lounges to choose from, you’ll enjoy a dizzying choice of dining options – each with a distinct theme, location and style. Whether you feel like an evening of terrific Thai or a night on the tiles with the finest cocktails, you’ll find your tastes fully satisfied at Madinat Jumeirah.\n\nThe property provides complimentary shuttle service to Wild Wadi Waterpark, Madinat Jumeirah and Jumeirah Beach Hotel.\n\nUmm Suqeim is a great choice for travellers interested in beaches, relaxation and restaurants.','King Salman bin Abdulaziz Al Saud Street','Madinat Jumeirah','',1,1,'043668888',NULL,'55.185968','25.135127',0,NULL,'0001-01-01 00:00:00.000000','0001-01-01 00:00:00.000000','ChIJORSp9gBCXz4RPBHkpF9_gtA',_binary '',0,0,1),(1,'admin@techtranz.com','2019-11-20 15:53:17.861598','admin@techtranz.com','2020-01-18 17:17:05.102399',291,2,NULL,'Hanaaya','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nNamed after the Arabic word for happiness, this chic restaurant is famous for its Friday brunch\n\nPlease check in at Talise Fitness or Talise Beach at Mina A\'Salam to receive a card and claim discounts.\n\nOPENING TIMES\nBreakfast: Sat – Thu, 6:30 – 11:30, Fri, 6:30 – 10:30 | Lunch: Sat – Thu, 12:30 – 15:30 | Dinner: 18:30 – 22:30 | Friday brunch: 12:30 – 16:00\n\nDRESS CODE\nCasual','King Salman bin Abdulaziz Al Saud Street','Madinat Jumeirah','',1,1,'044323232',NULL,'55.185968','25.135127',1,290,'2019-11-21 06:30:00.000000','2019-11-21 10:30:00.000000','ChIJORSp9gBCXz4RPBHkpF9_gtA',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 15:54:40.841089','admin@techtranz.com','2020-01-18 17:17:46.478343',292,2,NULL,'Tortuga','COVID Notice: Due to limited capacity, w