ainer and many more.\n\nTelephone +971 4 366 6821\nEmail: mjtalisefitnessreception@talisefitness.com','King Salman bin Abdulaziz Al Saud Street','Madinat Jumeirah Resort','',1,1,'+971 4 366 6821',NULL,'55.185968','25.135127',3,290,'2019-11-21 08:00:00.000000','2019-11-21 22:00:00.000000','ChIJORSp9gBCXz4RPBHkpF9_gtA',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-11-20 16:06:34.684876','admin@techtranz.com','2019-11-21 14:30:32.797449',299,2,NULL,'Club Lounge','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nGuests in our Suites and Executive rooms can make use of our exclusive benefits\n\nOur Club Lounge at Jumeirah Mina A\'Salam offers spectacular views over the Ocean and Burj Al Arab Jumeirah and gracious privileges.\n\nBreakfast in the Club Lounge from 7:00 - 10:30, or at Hanaaya\nAfternoon tea and light refreshments served from 15:00 - 16:30\nSundowners and a selection of canapés offered from 17:00 - 19:00\nTea, coffee and soft drinks are offered during operational hours, up until 19:00\nAdults-only access from 19:00 - 22:00 with a selection of alcoholic beverages at a prevailing charge\nComplimentary return transfers to/from Dubai International Airport for suite guests\nComplimentary one-way transfer to/from Dubai International Airport, for guests booking Executive rooms on our Best Available Rate\nComplimentary return transfers from Dubai International Airport for guests staying in suites\nClub Lounge is closed from 10:30 - 15:00 and 22:00 onwards.\n\n\nAdditional guest access to our Club Lounges\n\nYour guests are welcome to join you in our Club Lounges at a daily rate of:\n\nAED 350 per person (13 years old an above)\nAED 500 per couple\nChildren below 12 years old enjoy access with our compliments\nPlease note that this benefit does not include airport transfers. \n\n\nDress Code\n\nSmart casual (smart shorts allowed, no beachwear)\n\nFor more information, please contact us:\nTel: +971 4 366 6220','King Salman bin Abdulaz