their energy with a healthy and kids-friendly menu of Fairmont Lifestyle Cuisine available through our in-room dining service for an additional fee. \n\nOpen 10:30 am – 7:30 pm (Saturday to Wednesday) and 10:30 am to 9 pm (Thursday/Friday)\nFrom AED 65 per hour, per child\nSpecial birthday packages* are also available and can be booked directly with the club. \n\nBirthday party package for 2-4 years old\nBirthday party package for 4-8 years old  \nChildren are made to feel welcome the minute they arrive at Fairmont The Palm, with younger ones being entertained by our kids check in area with its very own dedicated and friendly front desk agents.\n\nUpon check in, the younger guests will receive an ‘I’m a Fairmont Kid’ backpack containing a host of kid friendly amenities such as a dedicated kids menu and ‘Kidos’ pretend currency money, which kids are encouraged to exchange for cookies, macarons, juice and ice creams at any of our restaurant outlets.\n\nWhat’s more, parents will also receive a special Gift Voucher from Fairmont The Palm’s exclusive partner and the largest mother & child shopping platform, ‘Mumzworld’.\n\nWatch our young guests enjoying their stay at Fairmont The Palm.\n\nFor more information, please call us on +971 4 457 3331, email us at palm.childrensactivities@fairmont.com or contact a member of our Concierge team.\n\n2 hours complimentary #select','Palm Jumeirah','','',1,1,'+971 4 457 3331',NULL,'55.1377404','25.1108784',6,30,'2019-11-22 10:30:00.000000','2019-11-22 19:30:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:05:38.880772','admin@techtranz.com','2019-12-18 14:13:05.067342',311,2,NULL,'HEALTH CLUB','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nGET FIT, FEEL FABULOUS\n\nPick up on your personal wellness goals or commit to getting fit with membership at the Fairmont The Palm Health & Beach Club. A great place to meet and make like-minded friends, get motivated and increase your overall fitness, our highly qualified team of friendly trainers will inspire you to reach new levels of health and wellness.\n\n90 DAYS TO A NEW YOU\n\nSign up today and get a head start on your fitness transformation with a special half-price summer membership offer that includes exclusive dining offers, personal training sessions and spa benefits.\n\nEnjoy:\n\n20% discount on personal training sessions\n20% discount at selected Fairmont The Palm restaurants and bars\n10% discount on Willow Stream Spa treatments\nThree-month membership rates\n\nAED 3,750 - Single\nAED 6,000 - Couple\nAED 7,500 - Family\nPERSONAL TRAINING\n\nWe all need a little extra motivation from time to time, especially when it comes to health and wellness. Whether you’re looking to get fit for life, lose those last few stubborn kilos, or tone up for a special occasion, our professional team of personal trainers can be the missing link in your total fitness regime.\n\nFor personal training sessions price options and packages, please contact the health club directly.\n\n We offer group classes and a wide range of indoor and outdoor activities.\n\nBeach Volleyball - daily, 4:30 - 5:30pm\nBeach Soccer - daily, 5:30 - 6:30pm\nAquaspin, Yoga, Table Tennis, Pool volleyball, Croquet.\nTo find out more on our Health Club activities, services and schedules, or for a complimentary initial consultation, call +971 4 457 3330 or email us at palm.healthclub@fairmont.com\n\n20% on Personal Training','Palm Jumeirah','','',1,1,'+971 4 457 3330',NULL,'55.1377404','25.1108784',3,30,'2019-11-22 08:00:00.000000','2019-11-22 22:00:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:10:25.405678','admin@techtranz.com','2019-11-22 13:10:32.501188',312,2,NULL,'WILLOW STREAM SPA','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWinner of ‘Best Resort Spa GCC’ at the 2018 Professional Beauty Awards GCC\n\nDownload our latest Willow Stream Spa Menu and tariff.\n\nFor our latest spa offers, please click here.\n\nWillow Stream Spas are Fairmont’s signature health and wellness spaces, and can be found at the heart of some of the world’s most dynamic cities, mountain retreats and on ocean shores. \n\nRelaxing, sensorial and social, our spas are an escape from the outside world where body, mind and soul are nourished and restored, leaving you energized from within.\n\nWillow Stream Spa at Fairmont The Palm reflects the energy of its surroundings, from the city’s urban joie de vivre and the unspoiled beauty of the surrounding desert, to the flowing waters of the Arabian Gulf.\n\nOur authentic spa experiences have been chosen with the utmost care and attention to detail, including our choice of exceptional spa products. \n\nKerstin Florian International, Dr. Levy Switzerland and Aromatherapy Associates represent a trio of acclaimed brands that each deliver unique holistic benefits when used as part of our therapies and rituals. \n\nSpa Day Pass: AED120 \n\nPhone: +971 4 457 3545\n\nEmail: palm.willowstream@fairmont.com \n\nTiming: 9 am to 10 pm\n\nAll prices are inclusive of 10% service charge, 7% percent municipality fee and 5% VAT.','Palm Jumeirah','','',1,1,'+971 4 457 3545',NULL,'55.1377404','25.1108784',5,30,'2019-11-22 09:00:00.000000','2019-11-22 22:00:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:13:55.170522','admin@techtranz.com','2019-11-22 13:13:59.596940',313,2,NULL,'POOL & BEACH','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nSHOOT THE BREEZE WITH POOL AND BEACH ACCESS\nMake the most of the cooler winter months and get your daily dose of Vitamin D at Fairmont The Palm. Swim, chill and relax at Palm Jumeirah’s most stylish beachfront location set against the impressive backdrop of the city skyline.\n\n Swimming Pool and Beach Hours: \n\nBeach Area: 6:30 am - until sunset, depending on season\nFamily Swimming Pool: 6:30 am - 7 pm (upper pools), 9:30 am - 6 pm (lower pool)\nAdult Swimming Pool: 6:30 am - 6 pm (lower pool), 9 am - 8 pm (upper pool)\nNorth Pool & South Pool: 9 am - 6 pm. \nAccess to visitors is temporarily not available. In-house guests enjoy complimentary access to the facilities.\n\nPool and Beach Menu can be found here.\n\nShisha services available daily from 12 pm to 4 pm.\n\nFor information, reservations and inquiries, please call +971 4 457 3330 or email us at palm.healthclub@fairmont.com','Palm Jumeirah','','',1,1,'+971 4 457 3330',NULL,'55.1377404','25.1108784',2,30,'2019-11-22 06:30:00.000000','2019-11-22 18:00:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:16:53.823961','admin@techtranz.com','2019-11-22 13:17:16.733453',314,2,NULL,'FREVO','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nDiscover Brazil on the beach at Frevo for an authentic taste of traditional Brazilian cuisine, where churrascaria-style dining is all about sharing good food and good conversation. Socialize with friends and family from appetizers through to desserts - and enjoy a distinctly playful ambience as you dine on the most succulent cuts of meat, carved tableside the traditional way.\n\nLobby level; choice of indoor or al fresco seating\nEspeto corridor-style service with selection of prime skewered meats carved tableside in South Brazilian style\nExtensive selection of exotic salads and resident ‘saladista’ for custom orders\nSignature menu of classic cachaça cocktails including the world-famous caipirinha\nBarclays Premier League football and other major sporting events shown on the big screen\nChildren welcome\nThe Frevo Churrascaria experience is priced at AED 295 per person. The Vegetarian Set menu is priced at AED 250.\n\nFor information on special prices for children dining at our restaurants, please click here.\n\n \n\nHours of Operation\nRestaurant\n\nSaturday to Wednesday: 6 pm to 11:30 pm \nThursday and Friday: 6 pm to 12 am\n\n \n\nDress Code\nSmart Casual\n\nReservations\nEmail palm.dining@fairmont.com or call +971 4 457 3457','Palm Jumeirah','','',1,1,'+971 4 457 3457',NULL,'55.1377404','25.1108784',1,30,'2019-11-22 18:00:00.000000','2019-11-22 23:30:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:18:12.247356','admin@techtranz.com','2019-11-22 13:18:19.534762',315,2,NULL,'SEAGRILL BISTRO','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nCelebrate the best of the ocean’s rich bounty at Seagrill Bistro, where expansive views of the Dubai Marina skyline add a romantic touch to any stay, and complement a generous menu of seafood platters, market-fresh fish and tender grill favourites. \n\nBeach level; choice of indoor and al fresco seating\nFresh fish, seafood platters, grilled meats\nExtensive Mediterranean-inspired beverage and sundowner cocktail menu \nChildren are welcome in the restaurant\nThe Seagrill Bistro Brunch, the chicest brunch in Dubai, is available every Friday. For more information, please click here.\n\nTo view our latest restaurant offers, please click here.\n\nFor information on special prices for children dining at our restaurants, please click here.\n\nHours of Operation\nThe restaurant, with both indoor and outdoor seating, is open for lunch and dinner daily from 12 pm - 11:30 pm.\n\nDress Code\nSmart Casual\n\nReservations\nEmail palm.dining@fairmont.com or call +971 4 457 3457','Palm Jumeirah','','',1,1,'+971 4 457 3457',NULL,'55.1377404','25.1108784',1,30,'2019-11-22 12:00:00.000000','2019-11-22 23:30:00.000000','ChIJI2DBjy1rXz4RNMB3Vz6-KeI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-11-22 13:19:13.751892','admin@techtranz.com','2019-11-22 13:19:20.968656',316,2,NULL,'DELICACY','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nPick up breakfast to go or a sweet treat fo