eve your desired results. Each PT develops and supervises a tailored programme to meet your requirements, and will provide the motivation required to help you achieve your goals.\n\nThe Aviation Club is located in the same complex as the hotel and offers our guests full use of its facilities, which include:\n\nFour tennis courts suitable for day and night matches, complimentary for hotel guests and The Aviation Club members\nA world class two-tier swimming pool with 25m lanes\nA 25m glass-bottomed lap pool at Cu-ba rooftop bar\nTwo squash courts, complimentary for hotel guests and The Aviation Club members\nGroup exercise studio\nRPM spin studio\nA gymnasium with state-of-the-art equipment\nPersonal training and fitness assessments\nComplimentary towels, water and headphones\nSaunas and steam rooms facilities in the locker areas\nJacuzzi and plunge pools in the locker areas\nSports shop offering a full range of gear and equipment\nTo view our Membership Terms and Conditions, click here \n\nDubai Fitness Challenge \nJoin in the Dubai 30x30 Challenge. Visit The Aviation Club to join our daily wellness and fitness classes.\n\nDubai Fitness Challenge (DFC) returns from 18 October to 16 November 2019 to transform Dubai into the most active city in the world. This initiative challenges everyone in the city to complete 30 minutes of activity a day for 30 days. \n\nFor more information, visit: dubaifitnesschallenge.com \n\n \n \nThe Aviation Club Group Exercise Classes\nOur group exercise classes offer a challenging and stimulating workout for all abilities. Designed by the industry\'s leading fitness instructors, each of our ten classes will help to make you fitter and stronger through fun group exercises. No matter what your fitness goals, our diverse range of classes offer new ways to stay in shape.\n\nTo view our Group Classes Timetable, click here.\n\n \n\nBodypump™\nBodypump™ is the original barbell class that strengthens your entire body. This 60-minute workout challenges all your major muscle groups by using weight-room exercises such as squats, presses, lifts and curls. Great music, awesome instructors and your choice of weight inspire you to get the results you came for – and fast.\n\n \n\nBodybalance™\nBodybalance™ is a Yoga, Tai Chi, Pilates workout that builds flexibility and strength and leaves you feeling centered and calm. Controlled breathing, concentration and a carefully structured series of stretches, moves and poses set to music create a holistic workout that brings the body into a state of harmony and balance.\n\n \n\nRPM™\nAn indoor cycling workout where you ride to the rhythm of powerful music. Take on the terrain with your inspiring team coach who leads the pack through hills, flats, mountain peaks, time trials and interval training. Discover the athlete within as you sweat and burn to reach an endorphin high.\n\n \n\nLes Mills Grit™\nA 30-minute high-intensity interval training (HIIT) workout, designed to improve strength and build lean muscle. This workout uses barbell, weight plate and body weight exercises to blast all major muscle groups. GRIT takes cutting edge HIIT and combines it with powerful music and coaches who’ll motivate you to go harder, to get fit, fast.\n\n \n\nBodycombat™\nAn empowering cardio workout where you are totally unleashed. This fiercely energetic programme is inspired by martial arts and draws from a wide array of disciplines such as Karate, Boxing, Taekwondo, Tai Chi and Muay Thai. Supported by driving music and powerful role model instructors, strike, punch, kick and kata your way through calories to superior cardio fitness.\n\n \n\nBodyattack™\nA sports-inspired cardio workout for building strength and stamina. This high-energy interval training class combines athletic aerobic movements with strength and stabilisation exercises. Dynamic instructors and powerful music motivate everyone towards their fitness goals – from the weekend athlete to the hardcore competitor.\n\n \n\nCXWORX™\nA 30-minute workout that hones in on the torso and sling muscles which connect your upper body to your lower body. It is ideal for tightening your tummy and butt, while also improving functional strength and assisting in injury prevention.\n\n \n\nBoot Camp™\nBootcamp is our first floor-based gym class. A high intensity workout aimed to keep you moving and maximize calorie burn, tones muscle, maximizes fat loss, and increase metabolism. Every workout if different and every person is given progression and regressions options so it’s perfect for both beginners and advanced.\n\n \n\nLes Mills Sprint™\nA 30-minute High-Intensity Interval Training (HIIT) workout, using an indoor bike to achieve fast results. It’s a short, intense style of training where the thrill and motivation comes from pushing your physical and mental limits. A high intensity, low impact workout, it\'s scientifically proven to return rapid results. The 30 minutes you put into a LES MILLS SPRINT workout drives your body to burn calories for hours. You combine bursts of intensity, where you work as hard as possible, with periods of rest that prepare you for the next effort. The payoff? You smash your fitness goals, fast.\n\n \n\nLes Mills Tone™\nIf you want the optimal mix of strength, cardio and core training this is it. Step into a Les Mills Tone™ class and you\'ll tick off a complete workout in 45 minutes. The challenging mix of lunges, squats, functional training and tubing exercises will help you burn calories and take your fitness to the next level.\n\n \n\nLes Mills Barre™\nA modern version of classic balletic training; a 30-minute workout designed to shape and tone postural muscles, build core strength, and allow you to escape the everyday. Incorporating classic ballet positions, with modern music, Les Mills Barre is a combination of cardio and strength with high reps of small range-of-motion movements and very light weights.\n\n \n\nTRX S.W.E.T\nAre you ready to SWET into another level of your training? This high energy, circuit-based class will have you moving better, training better and of course burning a calorie or two. Using the best in functional training equipment, world class TRX coaching and a unique partner based format you will have fun, get out of breath and of course, SWET.\n\n \n\nTRX Strong\nUsing the TRX Suspension Trainer and your own body weight this class will push you to new levels of strength. Feel the burn as you work through multiple sets of high tension loads in this time-based workout that features intermediate to advanced strength exercises. Cardio comes in the form of two unique blocks of strength exercises that deliver a high intensity workout.\n\n \n\nTRX Fit\nLooking for a perfect blend of strength and cardio? TRX FIT will improve your cardio, build muscular endurance and promote weight loss. Four great rounds of endurance using the TRX Suspension Trainer are followed by heart thumping cardio challenges. Get the TRX experience on your way to your best.\n\n \n\nHatha Yoga Sivananda\nThe Sivananda school is a time tested hatha flow that combines pranayama (breathing) and 14 postures with variation. This style works effectively on the physical mental and psychic bodies.\n\n \n\nAR Pilates\nAR Pilates aims at obtaining and maintaining the uniform development of the body, mental health, and the ability to perform daily tasks with ease, naturalness and spontaneity. This practise has barely changed since it was written in 1945.\n\n \n\nSwing Yoga\nSwing yoga or Aerial yoga also known as Anti-gravity yoga, is a modern style of yoga which combines the traditional yoga poses, with the use of a hammocks. By facilitating bending and stretching of the whole body during exercises, muscles and joints will be strengthened and rehabilitated, and the spine decompressed as the body hangs freely.\n\n \n\nReady Steady Go Kids\nOur physio-designed programme teaches children aged 1.5 – 6 the fundamentals of 10 sports, and develops essential motor skills in a fun, non-competitive environment. The focus is on largely on hand-eye/foot-eye coordination and balance.\n\n \n\nFor more information or to book a class, please contact us:\nTel: +971 4 230 8560\nEmail: jchtheaviationclub@jumeirah.com','Dubai - United Arab Emirates','','',1,1,'+971 4 230 8560',NULL,'','',3,NULL,'2019-11-22 08:00:00.000000','2019-11-22 22:00:00.000000','ChIJWUZm3BZdXz4RvPX4sIm3GVE',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-09 10:00:08.636827','admin@techtranz.com','2019-12-24 10:04:09.484370',326,2,NULL,'Polo Bar','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExperience a taste of Dubai’s high-life with a creative cocktail, a sophisticated cognac or indulge in the aroma and sensation of our fine selection of cigars. Located at ground floor level.','Al Falea Street','Jumeirah Beach','Jumeirah Beach Residence',1,1,'044084257',NULL,'55.1400667','25.0859939',4,1,'2019-12-09 10:00:00.000000','2019-12-09 01:30:00.000000','ChIJwQK0WFJrXz4RTP7D5F4Dku0',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-09 10:33:46.048283','admin@techtranz.com','2020-01-18 16:42:50.809072',327,2,NULL,'LIV','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLIV is W Dubai – The Palm’s three-meal venue that allows guests to “Liv a little”. We believe ‘Detox.Retox.Repeat.’ is much more fun so we want to deliver ‘retox’ with an edge. There are always lighter, brighter, fresher and brighter options on offer for breakfast, lunch and dinner.','West Crescent','Palm Jumeirah','',1,1,'042455800',NULL,'55.1113342','25.1062293',1,116,'2019-12-09 06:30:00.000000','2019-12-09 23:00:00.000000','ChIJbTHIgIEVXz4RIPXU6nFB2Gs',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-18 11:34:20.397279','admin@techtranz.com','2020-01-18 16:27:33.694442',328,2,NULL,'Kimpo','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nKoreans love their chicken and beer so much, they made