brate India’s rich culinary heritage with an authentic sharing selection of classic flavours, contemporary interpretations and her own family favourites.\n\nThe enduring appeal of signature dishes such as a velvety daal makhani, aromatic murgh malai kebabs and spicy Keralan chilli garlic prawns sit alongside exclusive creations including the Oman travels-inspired Muscat gosht, a fragrant boatman prawn curry and indulgent saffron-infused lamb kesar biryani. Asha’s bespoke beverage menu complements the dining experience with intriguing concoctions created by our international mixologist, and featuring distinctive Indian ingredients including cardamom, clove, rose jam, Assam and Darjeeling tea and jaggery.\n\nLunch\n12.30pm – 3.00pm\n\nDinner\n7.00pm – Midnight','Wafi Mall','Oud Metha','',1,1,'043244100',NULL,'55.3186636','25.2293867',1,306,'2019-12-19 12:30:00.000000','2019-12-19 00:00:00.000000','ChIJMfOf-DVdXz4Rv2MAmhEBS68',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:08:23.352214','admin@techtranz.com','2020-01-18 17:11:40.151599',347,2,NULL,'Carter\'s','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nA lively venue exuding colonial charm, Carter’s presents a delicious international menu including British favourites and gourmet delights in a relaxed and informal environment. Enjoy signature dishes such as the all-day breakfast and the authentic roast dinner whilst you watch the biggest sporting fixtures live.\n\nSat – Wed 12.00pm – 1.00am\n\nThurs & Fri 12.00pm – 2.00am\n\nVisit Carter’s every Monday from 8:30pm for an evening of trivia, prizes and fun with the weekly Quiz Night hosted by DJ Coxy. Does your team have what it takes to be crowned the week’s quizmasters? Find out this Monday and expect challenging rounds of music, general knowledge and giveaways at this fun-filled quiz night.\n\nCarter’s is the place to be if you’re looking for authentic British pub food, with the tempting Great British Dishes. Are you a fan of a roast dinner? Join us every Saturday for a traditional carvery dinner.\n\nIf that’s not enough, punters can look forward to wetting the whistle with a daily Happy Hour on selected house beverages, available every day between 4pm and 8pm.','Wafi Mall','Oud Metha','',1,1,'043244100',NULL,'55.3186636','25.2293867',1,306,'2019-12-19 12:00:00.000000','2019-12-19 01:00:00.000000','ChIJMfOf-DVdXz4Rv2MAmhEBS68',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:09:47.043413','admin@techtranz.com','2020-01-18 17:12:02.016379',348,2,NULL,'Thai Chi','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe perfect venue for all lovers of the Orient. Relaxed and informal, Thai Chi is two restaurants in one: Thai and Chinese. Expert chefs combine the best of Thai food with modern Chinese to create a delicious blend of flavours.\n\nEnjoy from a selection of Oriental favourites including Dim Sum, Tom Yum soup, Pad Thai and more. Thai Chi will take you on a culinary journey to the Far East.\n\nLunch\n12pm – 3.00pm\n\nDinner\n7.00pm – 12.00am','Wafi Mall','Oud Metha','',1,1,'043244100',NULL,'55.3186636','25.2293867',1,306,'2019-12-19 12:00:00.000000','2019-12-19 00:00:00.000000','ChIJMfOf-DVdXz4Rv2MAmhEBS68',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:12:42.121925','admin@techtranz.com','2020-01-18 17:12:31.943858',349,2,NULL,'Cleopatra\'s Spa - Pharaohs\' Club at WAFI','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExperience a spa like no other with luxurious gold baths, Egyptian style jacuzzis, and sauna. With separate sides for men and women, you’ll both be able to renew your inner and outer well-being with an extended menu of treatments enriched by ancient and international cultures of the world.\n\nIndulge in one of our many massage treatments, rejuvenate with a milk bath or why not try our glamorous Medi-Diamond facial – featuring real diamonds.\n\nDaily – 9am to 9pm (females)\nDaily –