oasted chicken.\n\nWhether you choose to dine in or take away, healthy delicious meals will be served, Pronto!\n\nHours of Operation\nOpen from 7am - 7pm, Sunday - Thursday\n\nOpen from 7am - 2pm, Saturdays\n\nDelivery service: call 800 4788 or place your order here.\n\nDress Code\nSmart Casual\n\nReservations\nFor more information, please call +971 4 311 8316 or email dbi.fbconcierge@fairmont.com','Sheikh Zayed Rd','','',1,1,'+971 4 311 8316',NULL,'','',1,350,'2019-12-19 07:00:00.000000','2019-12-19 19:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:35:29.853845','admin@techtranz.com','2019-12-19 10:35:41.028504',353,2,NULL,'THE CIGAR BAR','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nA modern twist on a traditional venue, The Cigar Bar evokes the feel and the charm of careless solitude.\n\nEnjoy the warm tones of the mahogany lined interior and rich dark enveloping furniture. Featuring an impressive selection of world-class cigars in a handcrafted, walk-in humidor, specialty cognacs and whiskies. This Dubai Cigar Bar is the best-kept secret for the true cigar aficionado.\n\nPrivate Cigar Lockers\n\nThe Cigar Bar has a limited number of private hand-crafted cigar lockers within its walk-in humidor that are made available to our most distinguished guests. All the lockers are temperature and humidity controlled and completely secure. \n\nOur in-house cigar sommelier will make sure your cigars are checked, cleaned and rotated on a weekly basis.  Private locker ownership also includes various benefits such as invite-only events and hotel discounts.\n\nHours of Operation\nOpen from 7pm - 3am, daily.\n\nDress Code\nSmart Casual\n\nReservations\nFor more information, please call +971 4 311 8316 or email dbi.fbconcierge@fairmont.com','Sheikh Zayed Rd','','',1,1,'+971 4 311 8316',NULL,'','',4,350,'2019-12-19 19:00:00.000000','2019-12-19 03:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_