ss Code\nSmart Casual\n\nReservations\nTo make a reservation or for more information, please call +971 4 311 8316 or email dbi.fbconcierge@fairmont.com','Sheikh Zayed Rd','','',1,1,'+971 4 311 8316 ',NULL,'','',1,350,'2019-12-19 06:30:00.000000','2019-12-19 23:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:42:00.377607','admin@techtranz.com','2019-12-19 10:42:18.836722',356,2,NULL,'CAFÉ SUSHI','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nTradition meets innovation in the form of a revolving sushi belt! This contemporary Japanese café in Dubai entices diners with tantalising delicacies, featuring a selection of uniquely crafted sushi and sashimi assortments.\n\nCafé Sushi is the perfect place for a relaxed business lunch or a quick healthy bite with friends. Delicious hand-made maki rolls, healthy salad selections and melt-in-your-mouth sushi are just some of the reasons why a lunch at Café Sushi is a must.\n\nWatch Café Sushi video.\n\nSee our restaurant offers here.\n\nHours of Operation\nOpen from 12 noon - 10pm, Saturday - Thursday\n\nDelivery service: call 800 4788 or place your order here.\n\n \n\nDress Code\nSmart Casual\n\nReservations\nFor more information, please call +971 4 311 8316 or email dbi.fbconcierge@fairmont.com','Sheikh Zayed Rd','','',1,1,'+971 4 311 8316',NULL,'','',1,350,'2019-12-19 12:00:00.000000','2019-12-19 22:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:45:56.169735','admin@techtranz.com','2019-12-19 10:46:10.357787',357,2,NULL,'The Spa at Fairmont Dubai','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFind your energy at this tranquil spa oasis. Experience a range of unique spa experiences combined with proven methodology for relaxation and rejuvenation. \n \nThe spa covers over 40,000 square feet and offers two distinct experiences; all offering luxury spa amenities in Dubai. One being the dedicated spa facility with a luxurious Romanesque feel throughout. It has separate male and female sections, both featuring an opulent Jacuzzi area with steam rooms, sauna, two relaxing footbaths and a total of seven private treatment and relaxation rooms. The second location offers state of the art health club facilities and Dubai fitness centre amenities.\n \nView our spa brochure here and price list here or watch our spa video.\n \nVisit our Spa special offers.\n \nTHE SPA EXPERIENCE\n \nThe Environment:  The spa is an adult sanctuary (guests must be 18 years of age or older). Mobile phones, Blackberry’s or other electronic devices are not permitted in the spa environment. If you wish to receive messages during your experience, please advise one of our spa experience coordinators who will be glad to assist you.\n \nSpa Experience Coordinators:  All of our spa experience coordinators are available to assist you in customising your own personal experience, from planning your treatments to answering any of your questions or concerns. \n \nSpa Arrival and Etiquette:  We recommend that you arrive 30 minutes prior to your scheduled appointment; to enjoy the heat and cooling facilities before your treatment begins. \n \nTo increase the movement of toxins in your body, use the sauna, steam room, or whirlpool. This will clear your breathing, start the cleansing process and warm your muscles. To bring your body temperature back to normal, have an ‘ice shower’ or enjoy a refreshing cold drink in the relaxation lounge.\n \nPlease leave your jewellery and valuables in your guest room safe or in the hotel safe. All treatments will end as scheduled, so that the next guest may begin on time.\n \nSpa Attire:  You will receive a robe and slippers to wear and a locker for your personal belongings. For your comfort, undergarments may be worn during treatments, however our therapists are highly trained in the correct draping procedures for your privacy. Please note, that swimsuits are required in some areas of the spa. \n \nHealth Matters:  Please inform us of any health conditions when booking your appointment e.g. high blood pressure, heart conditions, allergies or if you are pregnant. Also, consumption of alcohol before, during or directly after spa treatments is not recommended. \n \nGift Certificates:  Gift certificates are available for purchase for all spa services and packages. Please contact the Spa reception for further information.  \n \nPricing:  All prices are in UAE Dirhams and include 10% municipality fees and 10% service charge and are subject to change without prior notification.\n \nHours of Operation:  Spa appointments are available from 9am - 10pm.\n \nCancellation Policy:  If you reschedule or cancel your appointment, please notify the spa reception at least four hours in advance to avoid being charged.  Cancellation of a two or three hour package requires 24 hours notice. \nMaking An Appointment:  Please call 04 311 8800 or e-mail spadubai@fairmont.com. Advance reservations are recommended to accommodate your preferences.  ','Sheikh Zayed Rd','','',1,1,'+971 4 311 8800',NULL,'','',5,350,'2019-12-19 09:00:00.000000','2019-12-19 22:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:48:37.219913','admin@techtranz.com','2019-12-19 10:48:48.164713',358,2,NULL,'HEALTH CLUB','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nOur state of the art Health Club facilities and fitness centre in Dubai offers:\n\nTwo outdoor terrace pools; a sunrise pool and jacuzzi and a sunset pool with children’s pool area.\nThe health club features Technogym EXCITE 700E range of machines and free weights, including an elliptical trainer, stair climbers, stationary bikes and treadmills.\nPersonal trainers.\nBody shaping aerobics classes.\nSeparate male and female treatment rooms.\nSpa locker rooms.\nSteam room and sauna in separate male and female areas.\nHealth Club Membership is available for 1 month, 3 months, 6 months or annual periods. Members are entitled to a wide range of services and benefits.\n\nView our Health Club membership here.\n\nHours of Operation: \n\nThe Fitness Centre is open daily from 7am - 10pm\nSwimming pool is open daily from 7am - 10pm \nPlease call our spa reception on +971 4 311 8800 or email spadubai@fairmont.com and find out more about the members benefits and Dubai spa packages.','Sheikh Zayed Rd','','',1,1,'+971 4 311 8800',NULL,'','',3,350,'2019-12-19 07:00:00.000000','2019-12-19 22:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:50:38.880233','admin@techtranz.com','2019-12-19 10:50:49.632449',359,2,NULL,'Fairmont Dubai Pools','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nTwo outdoor terrace pools; a sunrise pool and jacuzzi and a sunset pool with children’s pool area.\n\nHours of Operation: \n\n\nSwimming pool is open daily from 7am - 10pm \n\nPlease call our spa reception on +971 4 311 8800 or email spadubai@fairmont.com and find out more about the members benefits and Dubai spa packages.','Sheikh Zayed Rd','','',1,1,'+971 4 311 8800',NULL,'','',2,350,'2019-12-19 07:00:00.000000','2019-12-19 22:00:00.000000','ChIJS3icWO5CXz4R2o0tnr8_lhI',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 10:53:45.218536','admin@techtranz.com','2019-12-19 10:54:52.009410',360,1,NULL,'Fairmont Ajman','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFairmont Ajman is a beachfront five star hotel beautifully situated in Ajman, the Sincerely Emirati emirate, just 30 minutes away from the bustling metropolis of Dubai. Ajman offers an exciting mix of beaches and mangroves to museums and malls that will tempt travelers of all ages. \n\nCombining hospitality and elegance with impeccable service, Fairmont Ajman promises a truly memorable experience during your