ng in advance.\n\n\nPlan the perfect Ajman family vacation\n\nWith adventures and activities perfect for kids of all ages, Fairmont Ajman truly is paradise for families! Kid’s will love all the entertainment programs and fun, educational activities. Imagine a family vacation at Fairmont Ajman from a child\'s perspective: building sandcastles, treasure hunts, movies by the pool, magic shows, water balloon games and new friends at every turn. This isn’t simply a place to play with Mom and Dad – it’s a wonderful expedition into the imagination.\n\nFeatured kid activities\n\nSandcastle building\nPizza Making classes\nMovies by the Pool\nMagic Shows\nTreasure Hunts\nFoot fishing for marbles\nWater balloon baseball and more.\n Hours of operation: 10am to 6pm, daily','Sheikh Humaid Bin Rashid Al Nuaimi Street','','',7,1,'+971 6 701 5757',NULL,'','',6,360,'2019-12-19 10:00:00.000000','2019-12-19 18:00:00.000000','ChIJ8z8L-XBXXz4RZRd6zRQ01bc',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 11:58:01.716519','admin@techtranz.com','2019-12-19 11:58:20.125821',371,2,NULL,'Lava Dining','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLava Dining, MediterrAsian restaurant','Mina Al Fajer','','',5,1,'+971 9 204 1111',NULL,'56.3546416','25.5861141',1,32,'2019-12-19 08:00:00.000000','2019-12-19 19:00:00.000000','ChIJJ6rsIuow9D4RAzu7TCzo3Hk',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:37:37.425538','admin@techtranz.com','2019-12-19 12:38:13.443691',372,1,NULL,'Sofitel Dubai The Palm','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nExperience world-class service at Sofitel Dubai The Palm Resort & Spa\nOne of our top picks in Dubai.\nSituated on the iconic Palm Jumeirah, Sofitel Dubai The Palm Resort & Spa is a Polynesian island feel resort. It features a spacious lobby with a green wall filled with 170 types of plants from France, free WiFi and 16 dining and entertainment outlets. It also offers a private beach, 3 pools and Amura kid’s club.\n\nAll the accommodations at Sofitel overlook the sea, the palm or the resort. Each one offers a flat-screen TV, a minibar, coffee and tea amenities, a wardrobe and a bose station. The suites and the apartments include a living room complete with a dining area and en-suite bathrooms that offer Lanvin or Hermes amenities.\n\nGuests can savor the various cuisines at Sofitel from International, French to Asian and Italian delicacies. Porter House offers succulent steaks and grills while Maui Beach serves cocktails by the beachside. Hong Loong offers an authentic Chinese cuisine with direct views of the sea and live cooking stations.\n\nThe So Spa offers 28 treatments rooms, seawater pool, sauna and French beauty treatments including massages and deep relaxation rooms. The So Fit is a high-tech gym equipped with the state-of-the-art cardio machines. For adventurous activities, guests have access to a boat jetty and 2 tennis courts.\n\nDubai Marina is a 10-minute drive from Sofitel Dubai The Palm Resort & Spa. Burj Khalifa and the Dubai Mall are 20 minutes away by car. Dubai International Airport is 38 km from the resort.\n\nPalm Jumeirah is a great choice for travellers interested in relaxation, beaches and family friendly trips.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 4 455 6677',NULL,'','',0,NULL,'2019-12-19 12:33:29.273000','2019-12-19 12:33:29.273000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:40:18.871796','admin@techtranz.com','2019-12-19 12:42:34.953433',373,2,NULL,'SOFITEL SPA','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nA place where time stands still and peace reigns supreme. Immerse yourself in a spa that places your well-being and rejuvenation at the center of all we do.\n\nHighlighting French-Polynesian traditions, highly trained therapists offer revitalizing body treatments, soothing massages and purifying facials using advanced techniques and organic ingredients. In their hands, you will see and feel immediate results. Whether you receive your personalized care indoors or within one of the secluded outdoor cabanas, the tranquil Polynesian setting further soothes your senses and imbues you with a deep sense of relaxation.\n\nAmong our spa services are two brand-new innovations in anti-aging and wellness. Oxygen Therapy accelerates cell regeneration, enhancing recovery from injuries and improving the luster of your skin and hair. Fast-acting and safe, Revitalife Drip is a state-of-the-art intravenous treatment that delivers vitamins, amino acids, hormones, DMSO (dimethyl sulfoxide) and/or MSM (methylsulfonylmethane) directly into the body for 100% absorption. The numerous benefits range from boosting the immune system and correcting hormonal imbalances to relieving joint pain and healing the gastrointestinal tract.\n\nBefore or after your treatment, spend some time and explore all that Sofitel SPA has to offer. The 2,500 square meter sanctuary features six distinct pools, including a plunge pool, experience pool, therapeutic pool and an outdoor infinity pool. For your comfort and privacy, the spa has separate zones for women and men – each with its own indoor pools, sauna, hammam and steam room. After a heat treatment, discover the refreshingly cool delights of the spa’s ice fountain. The salon, which is also segregated by gender, offers exceptional beauty and grooming treatments from head to toe.\n\nRestore balance. Revive your senses. Discover all the ways Sofitel SPA can breathe new life into your body and soul.\n\nFor enquiries, contact +971 44 55 66 77 or spa.palmdubai@sofitel.com','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',5,372,'2019-12-19 08:00:00.000000','2019-12-19 22:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:41:50.808634','admin@techtranz.com','2019-12-19 12:42:10.993853',374,2,NULL,'SOFITEL FITNESS','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nOpen to both resort guests and Dubai residents, the fitness gym at Sofitel Dubai The Palm combines advanced exercise equipment with our professional trainers’ expertise.\n\nLook out over palm trees and the Arabian Sea while working out on state-of-the-art treadmills, weight machines, stair steppers, punching bags and much more. Certified fitness instructors are on hand to offer assistance, advice and personalize a workout program to help you meet your fitness goals. FloatFit HIIT, personal fitness training, tennis lessons, swim lessons and group classes are available upon request.\n\nSofitel Dubai The Palm extends warm welcome to residents of Palm Jumeirah and greater Dubai who wish to use this health club’s amenities. Explore the options of the Teora membership program to take advantage of not only this exclusive workout space, but also unlimited access to our outdoor gym, sauna and steam rooms, the tennis and basketball courts, our 500-meter private beach, Amura Kids Club and the adults’ and children’s swimming pools. With an annual Teora membership, among the many privileges are four complimentary 50-minute massages and four day passes to the magnifique Sofitel SPA.\n\nQuench your thirst after your workout with a healthy smoothie prepared instantly at the Juice Bar. Discover a fitter, better and healthier you at this premier fitness center on the East Crescent of Palm Jumeirah.\n\nGROUP FITNESS CLASSES\nJoin an exercise class with your family, friends and other guests for a high-energy workout. Each session is led by a certified fitness trainer and features expert instructions, high-tech equipment and upbeat music. Classes are available for all fitness levels, so get ready to get pumped up in our state-of-the-art gym or on the rooftop with sweeping views of Palm Jumeirah. We also offer corporate exercise classes, so ask us for more details.\n\nCost per class:\nAED 30 for resident guests\nAED 50 for non-resident guests\n\nFor enquiries, contact +971 44 55 66 77 or recreation.palmdubai@sofitel.com','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',3,372,'2019-12-19 08:00:00.000000','2019-12-19 22:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:44:51.926646','admin@techtranz.com','2019-12-19 12:44:59.647032',375,2,NULL,'Porterhouse Steaks & Grills','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nOne of the most popular steakhouses on Palm Jumeirah Dubai, Porterhouse imports prime cuts of meat from celebrated producers around the world.\n\nIn the welcoming dining room, watch master chefs at work in the open kitchen. An extra special experience is the signature tabletop grill, where choice cuts such as Australian beef rib and Irish rack of lamb are carved at your table. Accompanying your meal are expertly prepared sauces and side dishes. Choose a grand cru from the wine cellar to add to the experience.\n\nEnd your meal on a delicious note with a decadent American dessert or a selection from the cheese trolley. For the little ones, Porterhouse proudly presents a complete menu designed specially for smaller appetites and choosy palates.\n\nEvery evening, a selection of background music adds to the lively ambiance. Regardless of which dishes you choose, Porterhouse Steaks & Grills delivers an unforgettable gastronomic experience.','The Palm Jumeirah East','Crescent Rd','',1,1,' +971 44 55 66 77',NULL,'','',1,372,'2019-12-19 12:30:00.000000','2019-12-19 23:30:00.000000','',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:47:50.187474','admin@techtranz.com','2019-12-19 12:48:03.907872',376,2,NULL,'Laguna Lounge','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFrom sunset until the wee hours of the morning, the beachside Laguna Lounge is the place on Palm Jumeirah for hot music, cold cocktails, freshly squeezed juices, delicious shared plates, dancing and a cool party vibe.\n\nThe lounge serves a selection of shishas until 2:30am, so gather around comfy couches with your best friends and listen to the DJ’s beats while admiring the sea and skyline views. Snack on gourmet treats like fresh sushi rolls accompanied by signature cocktails, fruity sangrias or vintage champagne.\n\nAfter brunching at Moana Seafood Restaurant, drop by Laguna Lounge for an After-Brunch Party offering a complimentary drink for ladies plus 50% off selected drinks until 8pm.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',4,372,'2019-12-19 12:30:00.000000','2019-12-19 03:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:49:30.037692','admin@techtranz.com','2019-12-19 12:49:39.131649',377,2,NULL,'Moana','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nAt this exquisite restaurant, seafood from the Arabia Sea and the world’s oceans are prepared with mastery and artistry. This pagoda-style restaurant, blending indoor and outdoor dining areas, brings out the best of fresh catches with Asian and European culinary techniques.\n\nFeast on French oysters, Canadian lobsters, Hokkaido scallops, Alaskan king crab legs, U.S. prawns and Norwegian salmon – on ice or freshly cooked. Our expert chefs create sushi, sashimi, nigiri and maki from the finest tunas and other seafood. The extensive menu continues with signature curries, divine soups and grilled specialties. The dessert selection features favorites from the Gulf region, East Asia and France. Children get their own menu featuring favorite seafood, pastas, sweets and beverages.\n\nFor a delicious weekend treat, seafood lovers will not want to miss Ocean Brunch on Fridays or Sushilicious Brunch on Saturdays, both served with free-flow beverages at Moana.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',1,372,'2019-12-19 12:30:00.000000','2019-12-19 23:30:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:52:30.058324','admin@techtranz.com','2019-12-19 12:52:35.140575',378,2,NULL,'Hong Loong','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nTraditional Chinese cuisine enlivened with modern touches, live cooking stations starring expert chefs plus authentic flavors from individual regions’ gastronomy. Hong Loong invites diners to experience gourmet dishes in an exciting setting.\n\nThe menu’s signature classics include Peking duck served with thin mandarin pancakes and sautéed lobster in exquisite XO sauce from Hong Kong. The restaurant’s clay pot dishes pay homage to Chinese comfort foods with a refined twist. Feast on noodles that are hand-pulled and prepared before your eyes. If little emperors and empresses would like to make their own choices, Hong Loong’s exciting and balanced children’s menu is sure to please all tastes and preferences.\n\nEnjoy your meal in the vibrant dining area, or entertain family and friends in the restaurant’s private banquet room. The décor of ebony, vermillion and gold adds sophistication and refinement. For a truly memorable culinary treat, indulge in our Dim Sum Night on Wednesdays and Thursdays. Traditionally a midday meal, this experience of unlimited dim sum and house tea is re-imagined in a cozy, low-light setting.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',1,372,'2019-12-19 18:30:00.000000','2019-12-19 23:30:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:54:41.510348','admin@techtranz.com','2019-12-19 12:54:45.433707',379,2,NULL,'Olivier\'s','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThe executive chef of Sofitel Dubai The Palm, Olivier Chaleil, has reimagined the lobby bar with his inimitable culinary and stylish sensibilities. Enter an elegant yet comfortable lounge and café, where a natural color palette exudes calm and refinement.\n\nPause for morning coffee or afternoon tea, and choose a house-made French pastry from the display case. The scents of baked goods and freshly brewed coffee are hard to resist. On the menu are also made-to-order crêpes, a chocolate fondue and a host of other creations designed by our head chef. The bar is also an ideal spot for an informal business meeting, lunch or afterwork gathering.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',1,372,'2019-12-19 00:00:00.000000','2019-12-19 00:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:55:57.545609','admin@techtranz.com','2019-12-19 12:56:01.122835',380,2,NULL,'Maui','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWhether dining indoors or at the water’s edge, this restaurant and bar brings the ambiance and flavor of the tropics to your table or lounge chair.\n\nDiscover the selection of delicious salads, sandwiches, pizzas, grilled dishes and power bowls at Maui. Pair your meal or snack with a hot or cold beverage, including smoothies, fresh juices, wines and Polynesian-inspired cocktails. From noon until closing, gather your friends to sample a variety of shishas. As afternoon draws to an end, enjoy special prices on beverages during Happy Hour. There’s never been a more delicious or relaxing way to while away the day and evening.\n\nFor an unforgettable culinary experience, treat your loved one to a candlelight dinner in a private beachside Tiki Cabana. Or opt for an intimate moonlight picnic on the waterfront. Our experienced servers take care of all the details, so all you have to do is revel in the romance.','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',1,372,'2019-12-19 11:00:00.000000','2019-12-19 18:30:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:57:18.336685','admin@techtranz.com','2019-12-19 12:57:30.037056',381,2,NULL,'The World Eatery','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWhen everyone in your group wants something different to eat, come to The World Eatery. Here the specialties of the house are favorites from the four corners of the globe – often in generous portions made to share.\n\nHot or cold Arabic mezze, a Scottish salmon platter, chicken quesadillas, Boston or Italian-style pizzas, prime U.S. beef, Polynesian cocktails, soba noodles, butter chicken masala – sample the world without ever leaving your table. The daily breakfast buffet which is equally tempting is available at AED155 for adults and AED80 for children aged 6 – 12 years.\n\nThis child-friendly restaurant is located in the building housing our luxury serviced apartments. After the little ones feast on dishes from their own menu, they can head to Amura Kids Club for supervised fun and activities. What a relaxing and delicious way to spend a weekend on Palm Jumeirah!','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 56 56',NULL,'','',1,372,'2019-12-19 06:30:00.000000','2019-12-19 23:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-19 12:58:39.860865','admin@techtranz.com','2019-12-19 12:58:44.611758',382,2,NULL,'Manava','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nThis cheery, family-friendly restaurant fully lives up to its name, which means “welcome” in Tahitian. For breakfast, brunch, lunch or dinner, Manava invites you to indulge in a lavish buffet of regional and international favorites. Works of Polynesian Art Nouveau adorn the walls and furnishings, while tropical blooms grace each table. Chefs at live cooking stations prepare and serve their signature dishes – adding sights, sounds and aromas to the vibrant atmosphere.\n\nDive deeply into culture with specially themed dinner buffets. From the pizzas and pastas of Italy to the delicacies of Arabian Nights, discover the variety of classic dishes and surprising flavors of gastronomic traditions from around the world.\n\nBreakfast is available at AED 155, lunch at AED 185 and dinner at AED 195 per person.\nChildren aged 6 – 12 years get 50% discount while those below 6 years dine with our compliments.\n\n','The Palm Jumeirah East','Crescent Rd','',1,1,'+971 44 55 66 77',NULL,'','',1,372,'2019-12-19 06:30:00.000000','2019-12-19 23:00:00.000000','ChIJT7L4OkoVXz4RfHHSWXRVB2Y',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-24 13:07:54.299588','admin@techtranz.com','2019-12-24 13:08:10.160713',383,2,NULL,'Willow Stream Spa at Fairmont Ajman','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nWillow Stream Spa at Fairmont Ajman restores your energy from its natural surroundings: the contemplation of turquoise-toned Arabian Gulf, calmness of wide sandy shores and the warmth of a setting sun. All the elements fused together to create a truly peaceful getaway in the smallest of the seven Emirates of the United Arab Emirates.\n\nOffering an array of lifestyle choices and encompassing total well-being, Willows Stream Spa at Fairmont Ajman combines an exclusive facility focusing on outdoor destination activities, spa and well-being. Our treatment menu includes a selection of authentic body treatments using locally inspired hammam products by Hammamii along with a collection of massage and facial treatments from Kerstin Florian to help skin achieve a state of optimum health and vitality.\n\nWillow Stream Spa helps you find your energy away from the hectic city life to a place of tranquil beauty and serenity.  Our spacious spa is laid out over 970square meters and includes nine luxuriously appointed spa suites including one couple’s suite and a nail and hair beauty bar for finishing touches.  The wet facilities are complete with  saunas, steam rooms and a private hammam room.  Allow us to delight and surprise you as we lead you on a sensory journey bringing overall balance and a sense of calm to your spa experience.\n\nHalf & full day spa packages are available and can be tailored to each guest needs.\n\nFor bookings, please call +971 (0) 6 701 5546  or email ajm.willowstream@fairmont.com.','Sheikh Humaid Bin Rashid Al Nuaimi Street','','',7,1,'067015546 ',NULL,'','',5,360,'2019-12-24 08:00:00.000000','2019-12-24 22:00:00.000000','ChIJ8z8L-XBXXz4RZRd6zRQ01bc',_binary '\0',0,0,NULL),(1,'admin@techtranz.com','2019-12-24 15:05:31.908687','admin@techtranz.com','2019-12-30 02:46:41.240752',384,2,NULL,'Pool - Breakwater Wellness Centre','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nLounge at the Infinity pool, walk the sandy beach or relax in one of the beach loungers. Send the children to play in the covered children\'s pool while you enjoy food and beverage service.','The Walk, Dubai Marina','','',1,1,'044533333',NULL,'55.1265145','25.0728376',2,91,'2019-12-24 08:00:00.000000','2019-12-24 22:00:00.000000','ChIJt-FjuVcTXz4RNrJCgQbutrQ',_binary '',0,0,NULL),(1,'admin@techtranz.com','2019-12-25 12:04:11.405078',NULL,'2019-12-25 12:04:11.405079',385,2,NULL,'Souk Madinat','COVID Notice: Due to limited capacity, we recommend calling in advance.\n\n\nFrom spices and slippers to locally made jewellery, the Souk Madinat Jumeirah is an Arabian bazaar, full of incredible finds. Wander through the stands and stalls under ornate lanterns and carved wood, immersing yourself in the shopping culture of this traditional Middle Eastern marketplace. Arrive by car, or by abra – a traditional Emirati boat - and stay for an hour, a day or an evening.\n\nWith over 25 restaurants, serving drinks and international cuisines, there are plenty of places to stop for a coffee, a light lunch, or a memorable dinner against the beautiful backdrop of Old Dubai.\n\nOpening Times\n